},{level=32,y=12,hp=3360,x=10,},},},},instances={{level=32,name=[[Brayflox's Longstop]],help=[[After a tiring journey across Eorzea, it is deep within the quiet jungles of Raincatcher Gully where the charismatic and enterprising young goblin, Brayflox Alltalks, chooses to build her tiny empire. What she does not realize, however, is that something else─something sinister─has also made the lush forest its home. Now driven from their rightful(?) claim, Brayflox and her brethren seek to retake the land, and are not above asking the help of lesser races (that would be you) to help them do so.]],},{level=50,name=[[Brayflox's Longstop (Hard)]],help=[[Brayflox's Longstop is overrun with forces of the Illuminati; the furious goblin scholars are bent on recovering a secret recipe centuries in the making and a moment in the filching. Having been pressed into service as Brayflox's boon companion, you have no choice but to disregard the facts of her thievery and defend the Longstop from all those who would seize it from its rightful holder.]],},},name=[[Brayflox's Longstop]],name_de=[[Brüllvolx' Langrast]],},[37]={name_fr=[[Palais Du Vagabond]],npcs={},enemies={},instances={{level=50,name=[[The Wanderer's Palace]],help=[[Decades of kobold mining deep beneath O'Ghomoro gradually weakened upper La Noscea to the point that when the Calamity struck, the land surrounding Bronze Lake collapsed, draining its waters and revealing a palace of unparalleled beauty. Thought to have been built by the Nymian civilization, which thrived in the area some fifteen centuries ago, the palace appears to have been dedicated to their patron deity, Oschon, the Wanderer. In search of the bounty she may hold, treasure hunters have already begun to delve into this forsaken place...but will treasure be the only thing they find?]],},{level=50,name=[[The Wanderer's Palace (Hard)]],help=[[Bound no more by the rancor of their fallen king, the tonberries have regained their senses─with a little help from devoted friends. Yet all thoughts of peace have been put to the blade, as a band of Mamool Ja mercenaries known as the Silverscales have stormed the walls and seized the place for their own. Someone must stop the sellswords from turning the Wanderer's Palace into an unassailable fortress, and take a stand against tonberry slaughter and slavery!]],},},name=[[The Wanderer's Palace]],name_de=[[Palast Des Wanderers]],},[39]={name_fr=[[Gridania]],npcs={},quests={{name=[[Tea Party Rules]],npc_name=[[Cemi Jinjahl]],genre_name=[[Carpenter Quests]],patch={name=[[Stormblood]],number=[[4.0]],},},{name=[[True To Life]],npc_name=[[Atelloune]],genre_name=[[Leatherworker Quests]],patch={name=[[Stormblood]],number=[[4.0]],},},{name=[[An Art For The Living]],npc_name=[[Y'mhitra]],genre_name=[[Summoner Quests]],patch={name=[[Stormblood]],number=[[4.0]],},},{name=[[Sweet Dreams Are Made Of Peace]],npc_name=[[Guydelot]],genre_name=[[Bard Quests]],patch={name=[[Stormblood]],number=[[4.0]],},},{name=[[The Trouble With Taxidermy]],npc_name=[[Atelloune]],genre_name=[[Leatherworker Quests]],patch={name=[[Stormblood]],number=[[4.0]],},},{name=[[Off The Record]],npc_name=[[Y'mhitra]],genre_name=[[Summoner Quests]],patch={name=[[Stormblood]],number=[[4.0]],},},{name=[[The Value Of Life]],npc_name=[[Atelloune]],genre_name=[[Leatherworker Quests]],patch={name=[[Stormblood]],number=[[4.0]],},},{name=[[An Egi-stential Crisis]],npc_name=[[Y'mhitra]],genre_name=[[Summoner Quests]],patch={name=[[Stormblood]],number=[[4.0]],},},{name=[[The Game Of Confidence]],npc_name=[[Beatin]],genre_name=[[Carpenter Quests]],patch={name=[[Stormblood]],number=[[4.0]],},},{name=[[Mounting Expectations]],npc_name=[[Atelloune]],genre_name=[[Leatherworker Quests]],patch={name=[[Stormblood]],number=[[4.0]],},},{name=[[Performing For Prin]],npc_name=[[Y'mhitra]],genre_name=[[Summoner Quests]],patch={name=[[Stormblood]],number=[[4.0]],},},{name=[[One More Night In Amdapor]],npc_name=[[E-Sumi-Yan]],genre_name=[[Gridanian Sideque