Only by slaying the renegade sylph leader Briaxio of the Well will the creatures' minds be freed.]],},{level=50,name=[[Urth's Fount]],help=[[In the moons following the Calamity, myriad rumors of ghastly creatures stalking the Twelveswood began spreading across the realm like wildfire. While most of the rumors have since been deemed unfounded, there is one series of events that has remained difficult to cast off as merely the ravings of broken-minded smallfolk: that concerning the supposed Dark Rider of the Shroud. After several deaths attributed to this mysterious figure, Seedseer O-App-Pesi sought communion with the spirits of the Twelveswood, only to learn that the rider was none other than the elder primal Odin. Slain in the Third Astral Era by an Allagan hero, why and how the primal has returned to Eorzea remains a mystery─one now in the capable hands of Eorzea's adventurers.]],},},name=[[South Shroud]],name_de=[[Südwald]],},[57]={name_fr=[[Forêt Du Nord]],npcs={{position={x=16.6,y=29.4,},name=[[Ademar]],},{position={x=21,y=25,},name=[[Aeluuin]],},{position={x=19.7,y=25.4,},name=[[Aethelmaer]],},{position={x=20.2,y=27.9,},name=[[Aethelstan]],},{position={x=21.8,y=26.7,},name=[[Aideen]],},{position={x=28.5,y=19.4,},name=[[Aluerad]],},{position={x=20.8,y=27.4,},name=[[Anaelle]],},{position={x=26.9,y=24.7,},name=[[Baptistaux]],},{position={x=30.3,y=19.7,},name=[[Berte]],},{position={x=21.8,y=26.2,},name=[[Black Rabbit Trader]],},{position={x=28.1,y=27.9,},name=[[Bledros]],},{position={x=29.1,y=19.7,},name=[[Bleidiud]],},{position={x=28.4,y=28.4,},name=[[Bodwine]],},{position={x=22.5,y=26.2,},name=[[Borlent]],},{position={x=23.9,y=27.5,},name=[[Bozol Eduan The Exact]],},{position={x=20.7,y=27,},name=[[Brien]],},{position={x=21.2,y=25.5,},name=[[Bryde]],},{position={x=30.4,y=19.8,},name=[[Caesaria]],},{position={x=19.4,y=29.3,},name=[[Chocobo]],},{position={x=20.4,y=28.6,},name=[[Chocobo]],},{position={x=27.9,y=20,},name=[[Chocobokeep]],},{position={x=21.5,y=26.3,},n