While little is known of the lady, it was said that she was exceptionally vain, and that to maintain her impeccable beauty, she would spare no expense. From facial creams concocted from rare Coerthan honeys to shampoos derived from the milk of exotic phurbles, her daily ritual of beauty treatments escalated until it was rumored she was bathing in the blood of her virgin maidservants. No amount of man-made tinctures, however, could hide the hideous scars she eventually suffered during the Calamity, and soon she was forced to turn to a darker solution, signing away her very soul in a final effort to literally “save face.”]],},{level=50,name=[[Haukke Manor (Hard)]],help=[[Scarred by the Calamity and warped by vanity, the lady of House Dartancours has made a bargain with the voidsent─and lost her soul, as is so often the case with such sketchy arrangements. Now, her manor house is a lair to all manner of dark beings, and the elite band of Wood Wailers sent to purge them has failed to report back. A second try is now in the works.]],},},name=[[Haukke Manor]],name_de=[[Haukke-Herrenhaus]],},[61]={name_fr=[[Mille Gueules De Toto-Rak]],npcs={},enemies={{name=[[Cell Mite]],positions={{level=24,y=9,hp=2011,x=10.4,},{level=24,y=8.9,hp=2011,x=6.2,},{level=24,y=8.9,hp=2011,x=10.9,},{level=1,y=9,hp=44,x=6.5,},{level=1,y=9,hp=44,x=14.1,},{level=24,y=8.6,hp=2011,x=9.1,},{level=24,y=8.8,hp=2011,x=9.1,},{level=24,y=8.8,hp=2011,x=14.2,},{level=1,y=8.8,hp=44,x=10.3,},{level=24,y=8.4,hp=2011,x=14.5,},{level=24,y=9.3,hp=2011,x=9,},{level=24,y=8.9,hp=2011,x=13.9,},{level=24,y=10.2,hp=2011,x=10.4,},{level=24,y=9.2,hp=2011,x=6.6,},{level=24,y=10.4,hp=2011,x=10.4,},{level=24,y=8.7,hp=2011,x=6.5,},{level=24,y=10.2,hp=2011,x=10.2,},{level=1,y=10.3,hp=44,x=11.6,},{level=24,y=9,hp=2011,x=10.5,},{level=1,y=9.7,hp=44,x=9.1,},},},{name=[[Coeurl O' Nine Tails]],positions={{level=24,y=10.3,hp=6545,x=9.6,},{level=24,y=13.5,hp=6545,x=9.1,},},},{name=[[Comesmite]],positions={{level=24,y=8.6,hp=1003,x=16