ive horned demon and a small army of its invincible minions have appeared, posing a threat to the Ishgardian knights stationed at the outposts nearby. For the time being, the creatures appear content with remaining on their rocky outcropping, but for how long they will remain is uncertain. Engage the voidsent, ignoring the incessant hounding of the minions, and focusing your efforts on their leader.]],},{level=35,name=[[Long Live The Queen]],help=[[At first, the now-frequent deadly avalanches in the Coerthas highlands were written off as displays of Oschon's might. That is, until local mountaineers spotted a giant bomb sending smaller explosives up onto the Nail to self-destruct, triggering massive cataracts of snow and rock. Knowing now the true cause of the matter, the Holy See has put a bounty on the floating head of this “bomb queen.” The task of regicide, however, will not be an easy one, for she is attended to by a retinue of royal subjects who are ready to serve her in any way necessary─including self-destruction.]],},},name=[[Coerthas Central Highlands]],name_de=[[Zentrales Hochland Von Coerthas]],},[64]={name_fr=[[Forteresse De Dzemael]],npcs={{position={x=8.7,y=9.3,},name=[[Dancing Wolf]],},{position={x=8.4,y=9.1,},name=[[Flame Personnel Officer]],},{position={x=8.6,y=9.1,},name=[[Ilberd]],},{position={x=8.6,y=9.1,},name=[[Kasasagi]],},{position={x=8.4,y=8.2,},name=[[Nenebaru]],},{position={x=9.2,y=9.3,},name=[[Rand]],},{position={x=8.6,y=9,},name=[[Raubahn]],},{position={x=8.9,y=9.1,},name=[[Skywatcher]],},{position={x=8.4,y=9,},name=[[Swift]],},{position={x=8.6,y=9,},name=[[Teledji Adeledji]],},{position={x=9.4,y=8.8,},name=[[Troubled Adventurer]],},{position={x=9.9,y=8.7,},name=[[Wymond]],},{position={x=8.8,y=9.3,},name=[[Y'mhitra]],},},enemies={{name=[[All-Seeing Eye]],positions={{level=44,y=16.3,hp=645000,x=11.1,},{level=44,y=12.8,hp=40850,x=12.2,},},},{name=[[Alpgrot Orobon]],positions={{level=44,y=14.7,hp=6815,x=12.9,},{level=44,y=11.2,hp=6815,x=7.8