0.1,hp=8611,x=15.4,},{level=50,y=12.4,hp=8611,x=15.4,},{level=50,y=10.6,hp=8611,x=15.1,},{level=50,y=11.4,hp=8611,x=13.9,},{level=50,y=12.6,hp=8611,x=15.1,},},},},instances={{level=50,name=[[Amdapor Keep]],help=[[Once, the lost civilization of Amdapor thrived in the Twelveswood, her citizens wielders of powerful, yet forbidden magicks which could be used to alter the very fabric of existence. However, as is oft the case with peoples who fancy themselves gods, the self-assuring hubris of the Amdapori eventually became their downfall, and as quickly as they rose to power, did they disappear from the world. For generations, this relic of their once-mighty civilization has remained hidden in plain sight─cloaked by the elementals who sought only to prevent newer generations from stumbling across the ancient Amdapori magicks. That is, until the Lambs of Dalamud─a dark cult who worships the now-fallen lesser moon as a god─dispelled the elementals' glamour by means unknown, and claimed the keep as their own. Now the crazed followers use its ancient chambers to perform blood sacrifices in an effort to resurrect their evil lord.]],},{level=50,name=[[Amdapor Keep (Hard)]],help=[[Though purging the Lambs of Dalamud brought a hard-earned peace unto Amdapor Keep, some mysterious fiend has completed the cultists' rites and ushered shadows back into the ruins. Voidsent now revel anew within these walls, their wickedness warping the flora and transforming kindly woodland creatures to bloodthirsty beasts. For the sake of the Twelveswood and the elementals who keep watch over it, you must cleanse the evil from the keep, and sweep away all traces of the cultists.]],},{level=50,name=[[Battle In The Big Keep]],help=[[How many realms has he traversed, and how many rivals has he felled? Gilgamesh journeys ever onward in his unending quest for the strongest of weapons. But the road is long and lonesome, and a painted rooster─loyal and noble as the bird may be─can bring a man only so much comfort in the darkest and most trying of times. So it was that Gilgamesh turned to the heavens, pleading to be reunited with a long-lost companion. Be it by fortune or fate, his prayers were heard, and the stage for the final confrontation is set. To the victor goes the Treaty-Blade!]],},},name=[[Amdapor Keep]],name_de=[[Ruinen Von Amdapor]],},[129]={name_fr=[[Moulin De La Carrière]],npcs={},enemies={},name=[[Quarrymill]],name_de=[[Mühlenbruch]],},[130]={name_fr=[[Guêpier Des Ventrerouge]],npcs={},enemies={},name=[[Redbelly Hive]],name_de=[[Rotbauch-Nest]],},[131]={name_fr=[[Camp Des Gobelins]],npcs={},enemies={},name=[[Goblins' Meet]],name_de=[[Goblin-Treff]],},[132]={name_fr=[[Feuillemorte]],npcs={},enemies={},name=[[Takers' Rot]],name_de=[[Rotthaufen]],},[133]={name_fr=[[Fontaine D'Urth]],npcs={},enemies={},name=[[Urth's Fount]],name_de=[[Urths Quelle]],},[135]={name_fr=[[Porte De La Vipère Jaune]],npcs={},enemies={},name=[[Yellow Serpent Gate]],name_de=[[Gelbschlangen-Pforte]],},[136]={name_fr=[[Écuries Des Murmures]],npcs={},enemies={},name=[[Treespeak Stables]],name_de=[[Flüsterhain-Stallung]],},[137]={name_fr=[[Tour D'E-Tatt]],npcs={},enemies={},name=[[E-Tatt's Spire]],name_de=[[E-Tatts Wachturm]],},[138]={name_fr=[[Arbre De L'Orée]],npcs={},enemies={},name=[[The Hedgetree]],name_de=[[Hagebaum]],},[139]={name_fr=[[Moulin Des Bois]],npcs={},enemies={},name=[[Hyrstmill]],name_de=[[Mühlenhain]],},[140]={name_fr=[[Radeau De La Calebasse]],npcs={},enemies={},name=[[Fallgourd Float]],name_de=[[Herbstkürbis-See]],},[141]={name_fr=[[Au Liège Flottant]],npcs={},enemies={},name=[[The Bobbing Cork]],name_de=[[Der Schwimmende Korken]],},[142]={name_fr=[[Tour De Florentel]],npcs={},enemies={},name=[[Florentel's Spire]],name_de=[[Florentels Wachturm]],},[143]={name_fr=[[Falaise Des Trouveurs]],npcs={},enemies={},name=[[Finders' Bluff]],name_de=[[Prospektoren-Höhle]],},[144]={name_fr=[[Ruines De Gelmorra]],npcs={},enemies={},name=[[Gelmorra Ruins]],name_de=[[Ruinen Von Gelmo