her of Ascian wisdom, the Amalj'aa have succeeded in summoning the mightiest incarnation of their god to date. Ifrit has returned amidst hellfire and brimstone, and the lizardmen bask in the heat of destruction as warriors of the Immortal Flames fall to the primal like slugs shriveling beneath the desert sun. Can a Warrior of Light prevail against such an irrepressible force?]],},},name=[[Bowl Of Embers]],name_de=[[Das Grab Der Lohe]],},[358]={name_fr=[[Jetée De L'Antre Des Loups]],npcs={{position={x=4.6,y=5.5,},name=[[Berkoeya Loetahlsyn]],},{position={x=5,y=6.2,},name=[[Blyssbryda]],},{position={x=5.3,y=6.3,},name=[[Celestria]],},{position={x=5.3,y=6,},name=[[Delivery Moogle]],},{position={x=5,y=5.3,},name=[[Disreputable Priest]],},{position={x=4.7,y=5.2,},name=[[Dominy]],},{position={x=5.8,y=5.8,},name=[[Faint-Hearted Fighter]],},{position={x=4.9,y=5.8,},name=[[Feast Quartermaster]],},{position={x=6.6,y=6.9,},name=[[Ferry Skipper]],},{position={x=6.1,y=5.4,},name=[[Hinene]],},{position={x=6.8,y=5.8,},name=[[Maelstrom Drill Sergeant]],},{position={x=4.6,y=6.3,},name=[[Storm Private]],},{position={x=4.5,y=6,},name=[[Storm Private]],},{position={x=4.5,y=6.2,},name=[[Storm Sergeant]],},{position={x=4.5,y=5.9,},name=[[Storm Sergeant]],},{position={x=4.5,y=6.1,},name=[[Storm Sergeant]],},{position={x=5.1,y=5.8,},name=[[Wolves' Den Mender]],},},quests={{name=[[Earning Your Wings]],npc_name=[[Softknox]],genre_name=[[La Noscean Sidequests]],patch={name=[[Patch 4.15]],number=[[4.15]],},},{name=[[It's Time To Duel]],npc_name=[[Faint-hearted Fighter]],genre_name=[[La Noscean Sidequests]],patch={name=[[Soul Surrender]],number=[[3.4]],},},},enemies={{name=[[Emerald Carbuncle]],positions={{level=60,y=5.3,hp=18170,x=5.1,},},},{name=[[Striking Dummy]],positions={{level=50,y=5.3,hp=2778,x=4.5,},{level=50,y=5.1,hp=2778,x=4.5,},{level=60,y=6,hp=16000,x=6.5,},{level=60,y=5.6,hp=16000,x=6.7,},{level=50,y=5.1,hp=2778,x=4.7,},{level=60,y=5.6,hp=16000,x=6.5,},{level=50,y=5.1,hp=2778,x=4.