50,name=[[The Navel (Hard)]],help=[[From deep within their mines, the kobolds have watched and waited for another opportunity to summon their Great Father and wreak havoc on Limsa Lominsa. With the destruction of the Ultima Weapon, the final obstacle to their plans was removed, allowing the beastmen to summon their god without fear of imperial reprisal. Once more, it falls to you to ensure that the Lord of Crags never sees the light of day.]],},{level=50,name=[[The Navel (Extreme)]],help=[[When northern Vylbrand is racked by an earthquake, Urianger Augurelt suspects the kobolds of summoning the primal Titan. The Scion of the Seventh Dawn is proven irritatingly correct in short order when the Lord of Crags appears in the mountains of O'Ghomoro to flaunt powers even greater than were supposed. It does not take an augur to see that a battle to the death must soon follow.]],},{level=50,name=[[Special Event I]],help=[[イベント用コンテンツ：3]],},},name=[[The Navel]],name_de=[[Der Nabel]],},[360]={name_fr=[[Lisière De Ronces]],npcs={},enemies={{name=[[Furryfoot Kupli Kipp]],positions={{level=50,y=6.1,hp=19501,x=6.2,},{level=50,y=6,hp=2778,x=6.3,},},},{name=[[Good King Moggle Mog XII]],positions={{level=50,y=6,hp=336915,x=6.1,},},},{name=[[Pukla Puki The Pomburner]],positions={{level=50,y=6.1,hp=19501,x=6.2,},{level=50,y=6.2,hp=2778,x=6.3,},},},{name=[[Pukna Pako The Tailturner]],positions={{level=50,y=6.2,hp=19501,x=6.1,},},},{name=[[Puksi Piko The Shaggysong]],positions={{level=50,y=6.2,hp=19501,x=6.1,},},},{name=[[Ruffletuft Kupta Kapa]],positions={{level=50,y=6.2,hp=21918,x=6.2,},},},{name=[[Whiskerwall Kupdi Koop]],positions={{level=50,y=6.1,hp=21918,x=6.1,},},},{name=[[Woolywart Kupqu Kogi]],positions={{level=50,y=6.1,hp=2778,x=6.3,},{level=50,y=6.1,hp=19501,x=6,},},},},instances={{level=50,name=[[Thornmarch (Hard)]],help=[[Good King Moggle Mog, the Twelfth of His Name, has once more been called forth by the Mogglesguard. Though the king is not considered a primal in the strictest sense, he poses a threat not unlike that of the beastman gods, in that his influence could corrupt his people's peaceful nature. And so, like those other aether-starved beings, he too must be felled for the sake of the realm.]],},{level=50,name=[[Thornmarch (Extreme)]],help=[[Kuplo Kopp's attempt to chastise the Mogglesguard for their dangerous and foolhardy actions has not had the intended effect. Reminded of how deadly the Twelveswood has become, the royal guards have instead channeled their fear and desperation into calling forth an even more potent potentate. The Good King Moggle Mog XII now styles himself the Great King Moggle Mog XII, and all the evildoers in the forest shall tremble before his majestic wrath!]],},},name=[[Thornmarch]],name_de=[[Dornmarsch]],},[361]={name_fr=[[Hurlœil]],npcs={},enemies={{name=[[Garuda]],positions={{level=50,y=5.8,hp=250020,x=6.1,},{level=50,y=5.6,hp=2778,x=5.8,},{level=50,y=6.1,hp=2778,x=6.1,},},},{name=[[Monolith]],positions={{level=50,y=6.2,hp=27780,x=6,},{level=50,y=6,hp=27780,x=6,},{level=50,y=6.3,hp=27780,x=6.3,},{level=50,y=6,hp=27780,x=6.2,},},},{name=[[Razor Plume]],positions={{level=50,y=6.5,hp=2083,x=6.1,},{level=50,y=6.4,hp=2083,x=6.4,},{level=50,y=6.3,hp=2083,x=5.7,},{level=44,y=5.9,hp=215,x=6.4,},{level=50,y=6.1,hp=2083,x=5.7,},{level=50,y=5.7,hp=2083,x=6.1,},{level=50,y=5.8,hp=2083,x=5.9,},{level=44,y=6.1,hp=215,x=6.6,},},},},instances={{level=44,name=[[The Howling Eye]],help=[[With the aid of the Enterprise and its legendary captain, Cid Garlond, you have broken through the swirling winds that shield the Howling Eye. Yet the challenges you have surmounted pale in comparison to the one that awaits you beyond the gates. At long last, the end is nigh─be it Garuda's or your own. ]],},{level=50,name=[[The Howling Eye (Hard)]],help=[[Not to be outdone by the Amalj'aa, the Ixal have also taken advantage of the Ultima Weapon's destruction and again summoned their patron deity. What is worse, this most recent incarnation of Garuda is said to possess a nigh-insatiable appetite for destruction. If Coerthas and the Twelveswood are to be spared further destruction, you must return to the Howling Eye and seek an audience with the Lady of the Vortex.]],},{level=50,name=[[The Howling Eye (Extreme)]],help=[[An attack by the primal Garuda has annihilated an entire Twin Adder brigade, with the sole survivor left to tell a tale writ in terror and misery. Garuda's powers are far greater than they should be; left with few options and all but one of them almost certain failures, the Order of the Twin Adder turns to the Scions of the Seventh Dawn, so that they may summon a Warrior of Light.]],},},name=[[The Howling Eye]],name_de=[[Das Tosende Auge]],},[362]={name_fr=[[Nid De Serpents]],npcs={},enemies={},name=[[The Serpent's Tongue]],name_de=[[Das Schlangennest]],},[363]={name_fr=[[Frai De Sapsa]],npcs={},enemies={},name=[[Sapsa Spawning Grounds]],name_de=[[Sapsa-Laichplatz]],},[364]={name_fr=[[Campement Sahuagin]],npcs={},enemies={},name=[[Sahagin Landbase]],name_de=[[Sahagin-Feldlager]],},[365]={name_fr=[[Wharf Des Pillards]],npcs={},enemies={},name=[[Reaver Hide]],name_de=[[Hafen Der Geborgenheit]],},[366]={name_fr=[[Sanatorium Du Vin Chaud]],npcs={},enemies={},name=[[Warmwine Sanitorium]],name_de=[[Warmwein-Sanatorium]],},[368]={name_fr=[[Quai De Port-aux-Ales]],npcs={},enemies={},name=[[Aleport Docks]],name_de=[[Fähranleger - Bierhafen]],},[370]={name_fr=[[Quai De La Crique Du Croissant]],npcs={},enemies={},name=[[Crescent Cove Docks]],name_de=[[Pier - Mondsichel-Bucht]],},[371]={name_fr=[[Quai Du Bazar Argenté]],npcs={},enemies={},name=[[Silver Bazaar Docks]],name_de=[[Pier - Silberbasar]],},[372]={name_fr=[[2e Sous-sol]],npcs={},enemies={},name=[[B2]],name_de=[[2. Untergeschoss]],},[373]={name_fr=[[Faubourg De Thal]],npcs={},enemies={},name=[[Merchant Strip]],name_de=[[Thal-Kreuzgang]],},[374]={name_fr=[[Salon De L'Aube]],npcs={},enemies={},name=[[The Solar]],name_de=[[Saal Der Morgenr