Though the knights of Ishgard breach the gate to find a lodgment within the Vigil, the enemy is well defended and amply supplied. This deadlock must be broken─and who better than those who once made free of the fortress under the dragons' very noses, and lived to tell the tale?]],},},name=[[Stone Vigil]],name_de=[[Steinerne Wacht]],},[402]={name_fr=[[Poste De L'Arête Blanche]],npcs={},enemies={},name=[[Whitebrim Front]],name_de=[[Weißenfels-Front]],},[403]={name_fr=[[Territoire Du Béhémoth]],npcs={},enemies={},name=[[Behemoth's Dominion]],name_de=[[Behemoth-Dominium]],},[404]={name_fr=[[Manteneige]],npcs={},enemies={},instances={{level=50,name=[[Snowcloak]],help=[[Formed in the aftermath of the Calamity, the great ice wall has long been thought an impenetrable barrier between central and western Coerthas. In truth, however, the wall is riddled with hidden tunnels, which Iceheart and her followers have used as a base of operations. You have been tasked with exploring one such tunnel in the hopes that it will lead you to the heretics' leader─yet what dangers await are anyone's guess...]],},},name=[[Snowcloak]],name_de=[[Schneekleid]],},[405]={name_fr=[[L'Épée]],npcs={},enemies={},name=[[The Nail]],name_de=[[Der Schwertrücken]],},[406]={name_fr=[[Avancée De La Foi]],npcs={{position={x=6.1,y=6.1,},name=[[Estinien]],},},enemies={},instances={{level=50,name=[[The Steps Of Faith]],help=[[The Steps of Faith─the sole means of approaching the city of Ishgard. As well as providing passage across the Sea of Clouds, this great stone bridge also serves to anchor the series of arcane wards known as Daniffen's Collar.

Long has the Holy See relied upon these barriers to shield the city from Dravanian assault, but it did not reckon upon the brazen actions of Lady Iceheart. The outermost layer of protection has been dispelled, allowing the mighty dragon Vishap to land upon the far end of the Steps of Faith. Leading an army of lesser kin, the massive creature is intent on destroying the exposed foundations of the remaining wards. Take up position alongside the Temple Knights, and defend the structure from the ravaging forces of the Horde!]],},{level=60,name=[[The Final Steps Of Faith]],help=[[Imbued with Hraesvelgr's last sliver of hope, you stand at the forefront of your allies as the last bastion against the raging shade of Nidhogg. Have you the resolve to conquer the great wyrm at the height of his power, or will Ishgard perish in fire and ruin? Here, on the battle-stricken Steps of Faith, your deeds shall decide how the final verse of a thousand-year dirge of grief and vengeance will be sung.]],},{level=60,name=[[The Minstrel's Ballad: Nidhogg's Rage]],help=[[Scarcely had Nidhogg fallen on the Steps of Faith, when taverns across Eorzea began to rumble with the rumors of your victory. In one such establishment did you regale a certain story-starved bard with the true details of your accomplishment─a humble account that he soon expanded into a flowery ballad of heroic proportions. Even as the lilting notes fade away, your mind is carried off by recollections of a monstrous foe, writ considerably more terrifying by the wandering minstrel's exaggerated poetry...]],},},name=[[Steps Of Faith]],name_de=[[Schicksalsweg]],},[407]={name_fr=[[Mer De Nuages]],npcs={},enemies={},name=[[Sea Of Clouds]],name_de=[[Wolkenmeer]],},[408]={name_fr=[[Forêt Centrale Ouest Via La Porte Du Loup Blanc]],npcs={},enemies={},name=[[White Wolf Gate (Central Shroud)]],name_de=[[Weißwolf-Pforte (zum Tiefen Wald / West)]],},[409]={name_fr=[[Fangebrume]],npcs={},enemies={},name=[[Fogfens]],name_de=[[Nebelmoor]],