emies={},name=[[Command Chamber]],name_de=[[Kommandoraum]],},[452]={name_fr=[[Hall Central]],npcs={},enemies={},name=[[Central Hall]],name_de=[[Zentrale Halle]],},[453]={name_fr=[[L'Échelon]],npcs={},enemies={},name=[[The Echelon]],name_de=[[Echelon-Lift]],},[454]={name_fr=[[Laboratoire Premier]],npcs={},enemies={},name=[[Laboratorium Primum]],name_de=[[Laboratorium Primum]],},[455]={name_fr=[[Atelier Magitek]],npcs={},enemies={},name=[[Magitek Research]],name_de=[[Magitek-Forschungsbereich]],},[456]={name_fr=[[Ascenseur Magitek]],npcs={},enemies={},name=[[Magitek Lift]],name_de=[[Magitek-Lift]],},[457]={name_fr=[[Porta Decumana]],npcs={},enemies={},name=[[Porta Decumana]],name_de=[[Porta Decumana]],},[458]={name_fr=[[Salle D'identification De L'armement Magitek]],npcs={},enemies={},name=[[Armor Recognition Chamber]],name_de=[[Waffenerkennungskammer]],},[459]={name_fr=[[Hurlœil (abord)]],npcs={},enemies={},name=[[The Howling Eye]],name_de=[[Das Tosende Auge]],},[460]={name_fr=[[Quai Du Chantier Naval De Moraby]],npcs={},enemies={},name=[[Moraby Drydocks Landing]],name_de=[[Landeplatz Moraby-Trockendocks]],},[461]={name_fr=[[Quai Des îles D'Ombra]],npcs={},enemies={},name=[[Isles Of Umbra Docks]],name_de=[[Fähranleger - Phantominseln]],},[462]={name_fr=[[Mer De Rhotano]],npcs={},enemies={},instances={{level=54,name=[[Blood On The Deck]],help=[[]],},},name=[[Rhotano Sea]],name_de=[[Rhotano-See]],},[463]={name_fr=[[Le Ragnarok]],npcs={},enemies={},name=[[The Ragnarok]],name_de=[[Die Ragnarök]],},[464]={name_fr=[[Site Impérial D'exploration Supérieur]],npcs={},enemies={},instances={{level=50,name=[[The Binding Coil Of Bahamut - Turn 1]],help=[[Situated upon Vylbrand, Castrum Occidens is more akin to a research facility than a fortress. Even before its first pillar was driven into the ground, Legatus Gaius van Baelsar had ordered his people to probe the fragment of Dalamud which fell at that precise location. The impact resulted in the creation of vast caverns pervaded by corrupted crystals. Though unknown dangers lie in wait within, you must brave them all if you are to learn the truth of the Calamity.]],},},name=[[Upper Aetheroacoustic Exploratory Site]],name_de=[[Obere ätheroakustische Grabung]],},[465]={name_fr=[[Site Impérial D'exploration Inférieur]],npcs={},enemies={},instances={{level=50,name=[[The Binding Coil Of Bahamut - Turn 2]],help=[[At the depth of 912 yalms, you find your path blocked by Dalamud's internal defenses. Born of advanced Allagan science, these spherical constructs are still fully functional even after eras in existence, and will seek to annihilate all intruders or be destroyed in attempt.]],},},name=[[Lower Aetheroacoustic Exploratory Site]],name_de=[[Untere ätheroakustische Grabung]],},[466]={name_fr=[[Le Ragnarok]],npcs={},enemies={},instances={{level=50,name=[[The Binding Coil Of Bahamut - Turn 3]],help=[[At the depth of 1,233 yalms, your party comes upon the fragment of Dalamud the Garleans had sought. Its true identity is the Ragnarok, a colossal starship which fell away from the lesser moon moments before Bahamut burst free of his prison over the Carteneau Flats. To reach your destination, you must venture through this relic of ancient Allag. Stay ever on your guard, for every shadow may conceal dangers.]],},},name=[[The Ragnarok]],name_de=[[Die Ragnarök]],},[467]={name_fr=[[Cylindre Propulseur Du Ragnarok]],npcs={},enemies={},instances={{level=50,name=[[The Binding Coil Of Bahamut - Turn 4]],help=[[At 1,524 yalms below the surface, employing the Ragnarok's drive cylinder as a makeshift lift, your party proceeds toward the main bridge. Yet you must work for every yalm you gain, for Dalamud's internal defenses will not allow you to pass unmolested.]],},},name=[[Ragnarok Drive Cylinder]],name_de=[[Antriebszylinder Der Ragnarök]],},[468]={name_fr=[[Noyau Central Du Ragnarok]],npcs={},enemies={},instances={{level=50,name=[[The Binding Coil Of Bahamut - Turn 5]],help=[[Having overcome the seemingly endless waves of hostile constructs, you and your stalwart companions continue the descent into an unknown abyss. At the depth of 1,910 yalms, you are assailed by a winged terror: an ancient dragon brought to heel by the Allagans and made to do their bidding. The trials grow ever more arduous, but you are resolved to press on for the sake of the truth.]],},},name=[[Ragnarok Central Core]],name_de=[[Kernsektor Der Ragnarök]],},[469]={name_fr=[[Pont Principal Du Ragnarok]],npcs={},enemies={},name=[[Ragnarok Main Bridge]],name_de=[[Kommandobrücke Der Ragnarök]],},[470]={name_fr=[[Guide Du Labyrinthe (vers Le Malm Du Minotaure)]],npcs={},enemies={},name=[[Labyrinth Guide (to The Minotaur Malm)]],name_de=[[Labyrinthführer (zum Minotauren-Malm)]],},[471]={name_fr=[[Guide Du Labyrinthe (vers La Thébaïde De Nald)]],npcs={},enemies={},name=[[Labyrinth Guide (to Nald's Reflection)]],name_de=[[Labyrinthführer (nach Nalds Besinnung)]],},[472]={name_fr=[[Refuge Des Sables]],npcs={},enemies={},name=[[The Waking Sands]],name_de=[[Sonnenwind]],},[473]={name_fr=[[Garde De La Porte Du Loup Blanc]],npcs={},enemies={},name=[[White Wolf Gate Guard]],name_de=[[Torwache]],},[474]={name_fr=[[Quartier Des Soldats]],npcs={},enemies={},name=[[Training Area]],name_de=[[Ausbildungsplatz]],},[475]={name_fr=[[Quai De L'appontement Du Miroir]],npcs={},enemies={},name=[[Mirror Planks Docks]],name_de=[[Spiegelsee-Pier]],},[476]={name_fr=[[Quai De Lavandière]],npcs={},enemies={},name=[[Lavender Beds Docks]],name_de=[[Lavendelbeet-Pier]],},[477]={name_fr=[[Porta Decumana]],npcs={},enemies={},instances={{level=50,name=[[The Minstrel's Ballad: Ultima's Bane]],help=[[Inspired by tales of your victory over the Ultima Weapon, the wandering minstrel come to Revenant's Toll has composed an epic ballad in your honor. However, as minstrels are wont to do, he has embellished certain details for dramatic effect. Although it can hardly be considered an accurate retelling, you cannot deny his skill with words, for as 