t Des Wanderers (schwer)]],},[496]={name_fr=[[Rocher Des Tréfonds]],npcs={},enemies={},instances={{level=30,name=[[Seal Rock (Seize)]],help=[[Legend has it that Llymlaen sealed a giant serpent She Herself created within Swallowtail Roam, an island said to drift about the sea so that those with evil intentions might never find it. When Seal Rock was first discovered, many believed it to be the selfsame island─but its true nature remained unknown until the Calamity laid her secrets bare. Upon their return to the island following the fall of Dalamud, Allied forces discovered Allagan tomeliths containing a wealth of knowledge. They concluded that the entire island was in fact an Allagan construct─a proving ground for Omega and other technology they developed to combat the primal threat. As was the case in Carteneau, control of the island and its resources remain disputed, and peaceful negotiations have failed to achieve a resolution. And so, once more, they would settle the matter on the battlefield.]],},},name=[[Seal Rock]],name_de=[[Robbenholm]],},[497]={name_fr=[[Abalathia]],npcs={},enemies={},name=[[Abalathia's Spine]],name_de=[[Abalathia]],},[498]={name_fr=[[Dravania]],npcs={},enemies={},name=[[Dravania]],name_de=[[Dravania]],},[499]={name_fr=[[Phare De Sirius (brutal)]],npcs={},enemies={{name=[[Corrupted Aether]],positions={{level=60,y=11.1,hp=35200,x=11.3,},{level=60,y=11.2,hp=35200,x=11.5,},{level=60,y=11.2,hp=35200,x=11.3,},{level=60,y=11.3,hp=35200,x=11.5,},},},{name=[[Corrupted Flan]],positions={{level=60,y=12,hp=52800,x=11.1,},{level=60,y=11.3,hp=52800,x=10.5,},},},{name=[[Corrupted Slime]],positions={{level=60,y=11.3,hp=52800,x=10.4,},{level=60,y=12.1,hp=52800,x=11.2,},{level=60,y=12,hp=52800,x=11.2,},{level=60,y=11.3,hp=52800,x=10.5,},},},{name=[[Corrupted Sprite]],positions={{level=60,y=11.2,hp=28160,x=11,},{level=60,y=11.1,hp=28160,x=11.5,},},},{name=[[Corrupted Wolf]],positions={{level=60,y=11.4,hp=45760,x=11.3,},{level=60,y=11.1,hp=45760,x=11.3,},},},{