ll three coils sustaining and repairing the dreadful being must be deactivated. Filled with new determination, you assemble a group of courageous comrades and set your sights on the fragment of Dalamud found in the North Shroud.]],},},name=[[Dalamud's Shadow]],name_de=[[Meteoritenkrater]],},[1302]={name_fr=[[L'Écheveau]],npcs={},enemies={},instances={{level=50,name=[[The Second Coil Of Bahamut - Turn 2]],help=[[After battling your way through to the base of the colossal fragment that impales the ground in Alder Springs, your party enters the structure through an opening in its outer shell. The sight that greets you is of an endless procession of azure-lit passages, within which can be glimpsed the grotesque silhouettes of chimerical monstrosities.]],},{level=50,name=[[The Second Coil Of Bahamut (Savage) - Turn 2]],help=[[After battling your way through to the base of the colossal fragment that impales the ground in Alder Springs, your party enters the structure through an opening in its outer shell. The sight that greets you is of an endless procession of azure-lit passages, within which can be glimpsed the grotesque silhouettes of chimerical monstrosities.]],},},name=[[The Outer Coil]],name_de=[[Äußere Schächte]],},[1303]={name_fr=[[Secteur Central RCI-03]],npcs={},enemies={},instances={{level=50,name=[[The Second Coil Of Bahamut - Turn 3]],help=[[Your party activates the coil's lift-like mechanism, and, at a depth of 3,256 yalms, arrives within the interior of the internment hulk proper. The great cavern where the elder primal Bahamut dreams is yet many thousands of yalms distant. Explore the labyrinthine passages of the Ragnarok-class starship, and secure a route into the lowest levels of the hulk.]],},{level=50,name=[[The Second Coil Of Bahamut (Savage) - Turn 3]],help=[[Your party activates the coil's lift-like mechanism, and, at a depth of 3,256 yalms, arrives within the interior of the internment hulk proper. The great cavern where the elder primal Bahamut dreams is yet many thousands of yalms distant. Explore the labyrinthine passages of the Ragnarok-class starship, and secure a route into the lowest levels of the hulk.]],},},name=[[Central Decks]],name_de=[[Zentrale Decks]],},[1304]={name_fr=[[Salle De Contrôle RCI-03]],npcs={},enemies={},instances={{level=50,name=[[The Second Coil Of Bahamut - Turn 4]],help=[[At a depth of 6,329 yalms, your exhausted yet determined fellowship enters the hulk's operations deck. An impossible scene unfolds before you, the surreal landscape bathed in a crimson glare and holding the promise of epic conflict...]],},{level=50,name=[[The Second Coil Of Bahamut (Savage) - Turn 4]],help=[[At a depth of 6,329 yalms, your exhausted yet determined fellowship enters the hulk's operations deck. An impossible scene unfolds before you, the surreal landscape bathed in a crimson glare and holding the promise of epic conflict...]],},},name=[[The Holocharts]],name_de=[[Holosphäre]],},[1305]={name_fr=[[Premier Pont RCI-03]],npcs={},enemies={},name=[[Main Bridge]],name_de=[[Kommandobrücke RVH-03]],},[1306]={name_fr=[[Sentier Flottant]],npcs={},enemies={},name=[[Floating Pass]],name_de=[[Schwebender Pfad]],},[1307]={name_fr=[[Piste Du Golem]],npcs={},enemies={},name=[[The Golem Trail]],name_de=[[Steinweg]],},[1308]={name_fr=[[Huis De La Marque]],npcs={},enemies={},name=[[Scar's Edge]],name_de=[[Narbenrand]],},[1309]={name_fr=[[Grue De Transport Des Incubateurs]],npcs={},enemies={},name=[[Incubator Transport]],name_de=[[Inkubator-Transport]],},[1310]={name_fr=[[Entrepôt D'armes Biologiques]],npcs={},enemies={},name=[[Bioweapon Storage]],name_de=[[Biowaffen-Magazin]],},[1311]={name_fr=[[Transport D'armes Biologiques]],npcs={},enemies={},name=[[Bioweapon Deployment]],name_de=[[Biowaffen-Überstellung]],},[1312]={name_fr=[[Paroi Fissurée]],npcs={},enemies={},name=[[Breached Hull]],name_de=[[Wrack-Außenhülle]],},[1313]={name_fr=[[Pont Supérieur]],npcs={},enemies={},name=[[Upper Decks]],name_de=[[Oberes Deck]],},