 for victory.]],},},name=[[The Whorleater]],name_de=[[Der Wogenbrecher]],},[1335]={name_fr=[[Centre-ville D'Amdapor]],npcs={},enemies={},name=[[Central Amdapor]],name_de=[[Zentrum Von Amdapor]],},[1336]={name_fr=[[Sanctuaire Des Rêves]],npcs={},enemies={},name=[[Sanctum Of Dreams]],name_de=[[Traum-Sanktuarium]],},[1337]={name_fr=[[Premier Pilier]],npcs={},enemies={},name=[[First Column]],name_de=[[Pfeilerkopf I]],},[1338]={name_fr=[[Second Pilier]],npcs={},enemies={},name=[[Second Column]],name_de=[[Pfeilerkopf II]],},[1339]={name_fr=[[Raccourci De La Source]],npcs={},enemies={},name=[[Watergush Sneakway]],name_de=[[Moorsee-Schleichpfad]],},[1340]={name_fr=[[Pont De Fortune Des Intrus]],npcs={},enemies={},name=[[Unguest's Watercross]],name_de=[[Brett Für Höhewechseln]],},[1341]={name_fr=[[Décharge De Brayflox]],npcs={},enemies={},name=[[Brayflox's Drossdump]],name_de=[[Müllwerfen-Ort]],},[1342]={name_fr=[[Bivouac Des Intrus]],npcs={},enemies={},name=[[Unguest's Breachhold]],name_de=[[Geheimplatz Von Schlimmegast]],},[1343]={name_fr=[[L'Agora]],npcs={},enemies={},name=[[The Agora]],name_de=[[Die Agora]],},[1344]={name_fr=[[Square Du Calme]],npcs={},enemies={},name=[[Halcyon Court]],name_de=[[Friedensplatz]],},[1345]={name_fr=[[Tour Des Guérisseurs]],npcs={},enemies={},name=[[Tower Of White]],name_de=[[Weißmagischer Turm]],},[1346]={name_fr=[[Crypte Des Rêves]],npcs={},enemies={},name=[[Dream Gate]],name_de=[[Traumschwelle]],},[1347]={name_fr=[[Les Ténèbres Scellées]],npcs={},enemies={},name=[[The Arrested Darkness]],name_de=[[Siegelgewölbe]],},[1348]={name_fr=[[Le Cauchemar éveillé]],npcs={},enemies={},name=[[The Waking Nightmare]],name_de=[[Arabesken Der Angst]],},[1349]={name_fr=[[Barrière Improvisée]],npcs={},enemies={},name=[[Swiftmake Checkgate]],name_de=[[Bretterbarrikade]],},[1350]={name_fr=[[Salon De L'Aube]],npcs={},enemies={},name=[[The Solar]],name_de=[[Saal Der Morgenröte]],},[1351]={name_fr=[[Bivouac De Brayflox (brutal)]],npcs={},enemies={{name=[[Bomb]]