n the scales of battle!]],},{level=50,name=[[The Striking Tree (Extreme)]],help=[[Satisfied that the Warrior of Light has passed his trial, the primal Ramuh departs Eorzea for the aetherial sea. His sylvan thralls, however, unconvinced that their territory is truly safe, have focused their deep-rooted fear and spite into summoning their god anew. Can you rise to the challenge and prove your might once again? Crackling with the vengeful energies of his children's prayers, the Lord of Levin's judgment promises to be harsh indeed...]],},},name=[[The Striking Tree]],name_de=[[Baum Des Urteils]],},[1364]={name_fr=[[Débarcadère Des Deux Vipères]],npcs={},enemies={},name=[[Serpent Landing]],name_de=[[Sammelplatz Der Bruderschaft]],},[1365]={name_fr=[[Débarcadère Des Immortels]],npcs={},enemies={},name=[[Flame Landing]],name_de=[[Sammelplatz Der Legion]],},[1366]={name_fr=[[Débarcadère Du Maelstrom]],npcs={},enemies={},name=[[Storm Landing]],name_de=[[Sammelplatz Des Mahlstroms]],},[1367]={name_fr=[[Avant-poste Des Deux Vipères]],npcs={},enemies={},name=[[Serpent Outpost]],name_de=[[Posten Der Bruderschaft]],},[1368]={name_fr=[[Avant-poste Des Immortels]],npcs={},enemies={},name=[[Flame Outpost]],name_de=[[Posten Der Legion]],},[1369]={name_fr=[[Avant-poste Du Maelstrom]],npcs={},enemies={},name=[[Storm Outpost]],name_de=[[Posten Des Mahlstroms]],},[1370]={name_fr=[[Marchés Allagois]],npcs={},enemies={},name=[[Allagan Markets]],name_de=[[Allagischer Marktplatz]],},[1371]={name_fr=[[Temple Allagois Du Soleil]],npcs={},enemies={},name=[[Allagan Sun Temple]],name_de=[[Allagischer Sonnentempel]],},[1372]={name_fr=[[Habitations Allagoises]],npcs={},enemies={},name=[[Allagan Manors]],name_de=[[Allagischer Wohnbezirk]],},[1373]={name_fr=[[Héliodrome]],npcs={},enemies={},name=[[Heliodrome]],name_de=[[Heliodrom]],},[1374]={name_fr=[[Ruines Frontalières]],npcs={},enemies={},instances={{level=1,name=[[The Carteneau Flats: Heliodrome]],help=[[]],},{level=30,name=[[The Borderland Ruins 