ry has rekindled interest in Mistbeard's legendary hoard, and treasure hunters the realm over are now scrambling to find passage to the elusive isle.]],},{level=60,name=[[Hullbreaker Isle (Hard)]],help=[[Wealthy noble Teledji Adeledji has had his prized pet, a rare gil turtle, kidnapped by ruthless bandits who seek a sizable ransom for the gentle wavekin's return. Always a man of principle, Teledji Adeledji has decided that instead of caving to the bandit's demands, he will offer the ransom to anyone who can safely retrieve his pet from the clutches of evil.

After weakening the gil turtle, slay fire sprites and use their cores to light a special herb on fire. The smoke released should be powerful enough to put the creature to sleep, but only if the turtle is close enough to the flames.]],},},name=[[Hullbreaker Isle]],name_de=[[Schiffbrecher-Insel]],},[1378]={name_fr=[[Breuil Des Écumeurs]],npcs={},enemies={},name=[[Runner's Reel]],name_de=[[Schmugglerbucht]],},[1379]={name_fr=[[Butin De Barbe-Brume]],npcs={},enemies={},name=[[Hidden Cache]],name_de=[[Geheimversteck]],},[1380]={name_fr=[[Le Frimas]],npcs={},enemies={},name=[[The Haar]],name_de=[[Die Küstennebel]],},[1381]={name_fr=[[Crique Des Naufragés]],npcs={},enemies={},name=[[Survivor Spit]],name_de=[[Strand Der Rettung]],},[1382]={name_fr=[[Petit Hall]],npcs={},enemies={},name=[[Minor Hall]],name_de=[[Kleiner Saal]],},[1383]={name_fr=[[Place De L'Éthérite (Guilde Des Pugilistes/Immortels)]],npcs={},enemies={},name=[[Ul'dah Aetheryte Plaza]],name_de=[[Ätherytenplatz]],},[1384]={name_fr=[[Place De L'Éthérite (Guilde Des Aventuriers/menuisiers/Deux Vipères)]],npcs={},enemies={},name=[[Gridania Aetheryte Plaza]],name_de=[[Ätherytenplatz]],},[1385]={name_fr=[[Ehcatl]],npcs={},enemies={},name=[[Ehcatl]],name_de=[[Ehcatl]],},[1386]={name_fr=[[Mare Des Geignements]],npcs={},enemies={},name=[[Greeting Pond]],name_de=[[Gellerwatt]],},[1387]={name_fr=[[Sentier Des Flots]],npcs={},enemies={},name=[[The Pull]],name_de=[[Haffrinne]],},[1388]={name_fr=[[L'Embelle Sabordée]],npcs={},enemies={},name=[[Dead Man's Drink]],name_de=[[Besetztes Lager]],},[1389]={name_fr=[[Le Giron De La Sultane]],npcs={},enemies={},name=[[The Sultana's Lap]],name_de=[[Seemanns-Tor]],},[1390]={name_fr=[[La Chrysalide]],npcs={},enemies={},instances={{level=50,name=[[The Chrysalis]],help=[[A ruthless Ascian known as Nabriales has intruded upon the sanctum of the Scions of the Seventh Dawn, spiriting away both the Antecedent and the powerful relic she refused to yield. Pursue the Paragon through the dimensional rift and prise Minfilia─and Tupsimati─from his tenebrous grasp.]],},},name=[[The Chrysalis]],name_de=[[Chrysalis]],},[1391]={name_fr=[[Chapelle D'ivoire]],npcs={},enemies={},name=[[The Ivory Chapel]],name_de=[[Elfenbein-Kapelle]],},[1392]={name_fr=[[Maison Des Splendeurs De Rowena]],npcs={},enemies={},name=[[Rowena's House Of Splendors]],name_de=[[Rowenas Haus Der Wunder]],},[1393]={name_fr=[[La Forge De Diamant]],npcs={},enemies={},name=[[The Diamond Forge]],name_de=[[Die Diamantschmiede]],},[1394]={name_fr=[[Tunnel De L'hérésie]],npcs={},enemies={},name=[[Corruption]],name_de=[[Häretiker-Steig]],},[1395]={name_fr=[[Baume De La Sérénité]],npcs={},enemies={},name=[[Silence]],name_de=[[Stille Firnhöhle]],},[1396]={name_fr=[[Précipice Des Blizzards]],npcs={},enemies={},name=[[Conviction]],name_de=[[Schneesturm-Wand]],},[1397]={name_fr=[[Cache Des Hérétiques]],npcs={},enemies={},name=[[Contempt]],name_de=[[Kavernen Der Gläubigen]],},[1398]={name_fr=[[Cirque Aux Stalactites]],npcs={},enemies={},name=[[Oblivion]],name_de=[[Eissäulen-Arena]],},[1399]={name_fr=[[Amphithéâtre D'Akh Afah]],npcs={},enemies={{name=[[Ice Boulder]],positions={{level=50,y=5.9,hp=6833,x=5.9,},{level=50,y=5.8,hp=6833,x=6.3,},{level=50,y=6,hp=6833,x=6.4,},},},{name=[[Ice Soldier]],positions={{level=50,y=5.9,hp=25168,x=6.3,},{level=50,y=6.3,hp=25168,x=6.3,},{level=50,y=6.3,hp=25168,x=5.9,},{level=50,y=5.9,hp=25168,x=5.9,},},},{name=[[Shiva]],positions={{level=50,y=6.1,hp=277800,x=6.1,},{level=50,y=6,hp=2778,x=6.2,},{level=50,y=5.9,hp=704917,x=6.1,},{level=50,y=6.1,hp=277800,x=6.2,},},},},instances={{level=50,name=[[Akh Afah Amphitheatre (Hard)]],help=[[For as long as their nation has warred with Dravania, there have been Ishgardians who instead chose to ally themselves with the dragons. Shiva is said to have been among the first, hence why the heretics revere her as a saint. That Iceheart and her followers intend to summon Shiva with the crystals they have stolen is plain. But is this unprecedented act even possible? If so, then Ishgard─if not the entire realm─is in grave danger.]],},{level=50,name=[[Akh Afah Amphitheatre (Extreme)]],help=[[House Durendaire's efforts to establish an outpost in Snowcloak have met with disaster, owing to a surprise attack by Iceheart's followers. Now in possession of their former fortress, as well as a vast supply of crystals, the heretics are certain to summon Saint Shiva once more. If past experience is any indication, this new incarnation will be stronger than the last. Regardless, it changes nothing─ Iceheart's crusade cannot continue, and only you have the power to stop her.]],},},name=[[Akh Afah Amphitheatre]],name_de=[[Akh Afah]],},[1400]={name_fr=[[Havre Du Vagabond]],npcs={},enemies={},name=[[Asylum]],name_de=[[Zufluchtsstätte]],},[1401]={name_fr=[[Station D'épuration]],npcs={},enemies={},name=[[The Bellows]],name_de=[[Abwasserraum]],},[1403]={name_fr=[[Temple Enseveli De Qarn (brutal)]],npcs={},enemies={},name=[[The Sunken Temple Of Qarn (Hard)]],name_de=[[Versunkener Tempel Von Qarn (schwer)]],},[1404]={name_fr=[[Atrium De Lalafuto IV]],npcs={},enemies={},name=[[The Ambulatorium Of Lalafuto IV]],name_de=[[Viridarium Von Lalafuto IV.]],},[1405]={name_fr=[[Roseraie De Lalafuto Ier]],npcs={},enemies={},name=[[The Rosarium Of Lalafuto I]],name_de=[[Rosarium Von Lalafuto I.]],},[1406]={name_fr=[[Secteur Central RCI-06]],npcs={},enemies={},instances={{level=50,name=[[The Final Coil Of Bahamut - Turn 1]],help=[[Alisaie is resolved to go through with her quest to vanquish Bahamut, though it means confronting her beloved grandfather, whom the elder primal has made his thrall. With Alphinaud's cooperation, an aetherial pathway has been established which will take your party to one of the two internment hulks that remain to be disabled. Your foray begins in northern Thanalan, at the set of Dalamud's talons situated in Raubahn's Push. Spare no preparation and expect fierce resistance.]],},},name=[[IC-06 Central Decks]],name_de=[[Zentrale Decks RVH-06]],},[1407]={name_fr=[[Réseau De Régénération RCI-06]],npcs={},enemies={},instances={{level=50,name=[[The Final Coil Of Bahamut - Turn 2]],help=[[At the depth of 6,835 yalms, you and your companions are greeted by a breathtaking sight: a colossal replica of Dalamud, believed to be the device which regulates Bahamut's regeneration. The structure swarms with legions of the lesser moon's internal defenses, but through it you must go if you are to reach the main bridge.]],},},name=[[IC-06 Regeneration Grid]],name_de=[[Regenerationssektor RVH-06]],},[1408]={name_fr=[[Pont Principal RCI-06]],npcs={},enemies={},instances={{level=50,name=[[The Final Coil Of Bahamut - Turn 3]],help=[[At 8,872 yalms below the surface, your party arrives within Bahamut's cavernous regeneration chamber. As Alisaie moves to disable the internment hulk, she finds her way barred by her grandsire, the Archon Louisoix. The man once gave his life that the realm might be spared; if you would honor his legacy, you must now strike him down.]],},},name=[[IC-06 Main Bridge]],name_de=[[Kommandobrücke RVH-06]],},[1409]={name_fr=[[Cœur De Bahamut]],npcs={},enemies={},instances={{level=50,name=[[The Final Coil Of Bahamut - Turn 4]],help=[[Restored to his senses in defeat, Louisoix uses his final moments to send your party to the main bridge of the final internment hulk, there to banish Bahamut once and for all. Yet though the end of your arduous journey is in sight, doubt not but that the cornered primal will lash out with his unbridled rage. If you are to overcome this terrible foe, you and yours must be of one purpose. Join now your hearts and minds, and sally forth to bring the Seventh Umbral Era to its true conclusion─for the future of Eorzea!]],},},name=[[The Burning Heart]],name_de=[[Bahamuts Herz]],},[1410]={name_fr=[[Pont Principal RCI-04]],npcs={},enemies={},name=[[IC-04 Main Bridge]],name_de=[[Kommandobrücke RVH-04]],},[1411]={name_fr=[[Entrepôt D'armes Biologiques]],npcs={}