The voices of Idyllshire cry out, asking for aid ere their homes are crushed under the weight of iron. You must lead a band of valiant adventurers into the machina and discover how to destroy the core─lest the giant screeches again to life, and bleeds all the realm dry.]],},{level=60,name=[[Alexander - The Fist Of The Father (Savage)]],help=[[What fun is there in merely restating the facts? Never one to be content with the truth, the wandering minstrel has taken the liberty of retelling the tale of your journey into Alexander with his trademark embellishments. Some may question the value of such entertainment, but none can deny the skill with which he weaves his tapestry of song and verse, immersing you in memory...]],},},name=[[The Fist Of The Father]],name_de=[[Faust Des Vaters]],},[1629]={name_fr=[[Coursive D'entretien CE-583]],npcs={},enemies={},name=[[Serviceway #583]],name_de=[[Wartungsgang 583]],},[1630]={name_fr=[[Compartiment Machine CM-262]],npcs={},enemies={},name=[[Engine Room #262]],name_de=[[Maschinenraum 262]],},[1631]={name_fr=[[Hangar D'armement HA-44]],npcs={},enemies={},name=[[Machinery Bay 44]],name_de=[[Kampfmaschinen-Baracke 44]],},[1632]={name_fr=[[Grand Hangar GH-8]],npcs={},enemies={},name=[[Hangar 8]],name_de=[[Lagerhalle 8]],},[1633]={name_fr=[[Le Poignet Du Père]],npcs={},enemies={},instances={{level=60,name=[[Alexander - The Cuff Of The Father]],help=[[In your last foray into the giant's mighty arm, you narrowly escaped Quickthinx Allthoughts and the Illuminati with your life. Yet in so doing, you won a cryptic name─Alexander. Whatever this may be, your path leads into the gloom of Gordias. March onwards with courage, for it is only in the darkness that you can learn how to stop the iron colossus.]],},{level=60,name=[[Alexander - The Cuff Of The Father (Savage)]],help=[[What fun is there in merely restating the facts? Never one to be content with the truth, the wandering minstrel has taken the liberty of retelling the tale of your journey into Alexander with his trademark embellishments. Some may question the value of such entertainment, but none can deny the skill with which he weaves his tapestry of song and verse, immersing you in memory...]],},},name=[[The Cuff Of The Father]],name_de=[[Elle Des Vaters]],},[1634]={name_fr=[[Coursive D'entretien CE-542]],npcs={},enemies={},name=[[Serviceway #542]],name_de=[[Wartungsgang 542]],},[1635]={name_fr=[[Coursive D'entretien CE-541]],npcs={},enemies={},name=[[Serviceway #541]],name_de=[[Wartungsgang 541]],},[1636]={name_fr=[[Coursive D'entretien CE-539]],npcs={},enemies={},name=[[Serviceway #539]],name_de=[[Wartungsgang 539]],},[1637]={name_fr=[[Grand Hangar GH-12]],npcs={},enemies={},name=[[Hangar 12]],name_de=[[Lagerhalle 12]],},[1638]={name_fr=[[Le Bras Du Père]],npcs={},enemies={},instances={{level=60,name=[[Alexander - The Arm Of The Father]],help=[[In the Enigma Codex are writ the designs for a walking citadel. It was known as Alexander, a self-sufficient bastion for logic and reason and a beacon of knowledge for a world adrift─so says the treasure hunter Mide. The Illuminati dreamed this century-old dream, and in so doing gave form to their primal. Yet no matter how beautiful an ideal, the reality of fanatics with such power is a tarnished, ugly thing. By your hand must this threat be stopped.]],},{level=60,name=[[Alexander - The Arm Of The Father (Savage)]],help=[[What fun is there in merely restating the facts? Never one to be content with the truth, the wandering minstrel has taken the liberty of retelling the tale of your journey into Alexander with his trademark embellishments. Some may question the value of such entertainment, but none can deny the skill with which he weaves his tapestry of song and verse, immersing you in memory...]],},},name=[[The Arm Of The Father]],name_de=[[Arm Des Vaters]],},[1639]={name_fr=[[Coursive D'entretien CE-523]],npcs={},enemies={},name=[[Serviceway #523]],name_de=[[Wartungsgang 523]],},[1640]={name_fr=[[Stratègéion - Premier étage]],npcs={},enemies={},name=[[Strategeion - 1F]],name_de=[[Strategion - 1. Ebene]],},[1641]={name_fr=[[Stratègéion - Deuxième étage]],npcs={},enemies={},name=[[Strategeion - 2F]],name_de=[[Strategion - 2. Ebene]],},[1642]={name_fr=[[Stratègéion - Troisième étage]],npcs={},enemies={},name=[[Strategeion - 3F]],name_de=[[Strategion - 3. Ebene]],},[1643]={name_fr=[[Stratègéion - Quatrième étage]],npcs={},enemies={},name=[[Strategeion - 4F]],name_de=[[Strategion - 4. Ebene]],},[1644]={name_fr=[[Grand Condensateur GC-9]],npcs={},enemies={},name=[[Condensate Demineralizer #9]],name_de=[[Kondensatoranlage 9]],},[1645]={name_fr=[[Le Fardeau Du Père]],npcs={},enemies={},instances={{level=60,name=[[Alexander - The Burden Of The Father]],help=[[The Illuminati would see the lofty ideals of the Enigma Codex turned into warped elitism, and have their primal play host to their chosen few. From within its walls, they would control the world with cold logic, and crush opposition with a fist of iron. With your eyes opened to the goblin scholars' true ambitions, you must make your way farther past the pumping pistons and grinding gears of the colossus. Can you and your comrades destroy the core therein, or will you fall and so allow your foes to wreak ruin across the realm?]],},{level=60,name=[[Alexander - The Burden Of The Father (Savage)]],help=[[What fun is there in merely restating the facts? Never one to be content with the truth, the wandering minstrel has taken the liberty of retelling the tale of your journey into Alexander with his trademark embellishments. Some may question the value of such entertainment, but none can deny the skill with which he weaves his tapestry of song and verse, immersing you in memory...]],},},name=[[The Burden Of The Father]],name_de=[[Last Des Vaters]],},[1646]={name_fr=[[Square Des Chocobos (square Des Mascottes)]],npcs={},enemies={},name=[[Minion Square]],name_de=[[Chocobo-Platz (Halle Der Trabanten)]],},[1647]={name_fr=[[Le D