ls]],npcs={},enemies={},instances={{level=60,name=[[Alexander - The Fist Of The Son]],help=[[Although you succeeded in destroying the core of Gordias, it seems that was only a temporary measure. The walking fortress has stirred once more, and its left arm now rests on the banks of the Thaliak. The entrance lies open and unguarded, suggesting the goblins inside are as surprised as you. Take advantage of your enemy's unreadiness and face the Illuminati threat once more─hopefully for the last time.]],},{level=60,name=[[Alexander - The Fist Of The Son (Savage)]],help=[[Sometimes even the most thrilling tale can benefit from slight embellishment, and the wandering minstrel's reimagining of your foray into Midas─while stretching the bounds of believability─proves to be even more invigorating than your memory of it. A memory you must relive in order to compare...]],},},patch={number=[[3.2]],},name=[[The Fist Of The Son]],name_de=[[Faust Des Sohnes]],},[1709]={name_fr=[[Coursive D'entretien CE-721]],npcs={},enemies={},patch={number=[[3.2]],},name=[[Serviceway #721]],name_de=[[Wartungsgang 721]],},[1710]={name_fr=[[Compartiment Machine CM-334]],npcs={},enemies={},patch={number=[[3.2]],},name=[[Engine Room #334]],name_de=[[Maschinenraum 334]],},[1711]={name_fr=[[Goblaboratoire]],npcs={},enemies={},patch={number=[[3.2]],},name=[[The Clevering]],name_de=[[Forschenraum]],},[1712]={name_fr=[[Coursive D'entretien CE-726]],npcs={},enemies={},patch={number=[[3.2]],},name=[[Serviceway #726]],name_de=[[Wartungsgang 726]],},[1713]={name_fr=[[Gobexpérimentation Super-avancée]],npcs={},enemies={},patch={number=[[3.2]],},name=[[Advanced Clevering]],name_de=[[Fortschrittene Forschenraum]],},[1714]={name_fr=[[Le Poignet Du Fils]],npcs={},enemies={},instances={{level=60,name=[[Alexander - The Cuff Of The Son]],help=[[Upon returning from Midas, you learn that Mide surrendered the precious fragment of the Enigma Codex to the Illuminati, and that she was in fact a surviving member of a group of