、本来の力を発揮できなくなってしまう。さらに幻惑魔法によって、入る度に構造が変化して感じられるという有様……。死霊が目撃されたことで、いつしか「死者の宮殿」と呼ばれるようになっていた、この謎の迷宮を調査すべく、鬼哭隊は冒険者たちに協力を仰ぐのだった。]],},{level=1,name=[[The Palace Of The Dead (Floors 31-40)]],help=[[地下都市「ゲルモラ」時代の遺構「イソム・ハーの穴蔵」の奥底にて、未知の迷宮が発見された。その内部には、強力な「結界」が貼られており、ひとたび足を踏み入れれば、本来の力を発揮できなくなってしまう。さらに幻惑魔法によって、入る度に構造が変化して感じられるという有様……。死霊が目撃されたことで、いつしか「死者の宮殿」と呼ばれるようになっていた、この謎の迷宮を調査すべく、鬼哭隊は冒険者たちに協力を仰ぐのだった。]],},{level=1,name=[[The Palace Of The Dead (Floors 41-50)]],help=[[地下都市「ゲルモラ」時代の遺構「イソム・ハーの穴蔵」の奥底にて、未知の迷宮が発見された。その内部には、強力な「結界」が貼られており、ひとたび足を踏み入れれば、本来の力を発揮できなくなってしまう。さらに幻惑魔法によって、入る度に構造が変化して感じられるという有様……。死霊が目撃されたことで、いつしか「死者の宮殿」と呼ばれるようになっていた、この謎の迷宮を調査すべく、鬼哭隊は冒険者たちに協力を仰ぐのだった。]],},{level=1,name=[[The Palace Of The Dead (Floors 51-60)]],help=[[]],},{level=1,name=[[The Palace Of The Dead (Floors 61-70)]],help=[[]],},{level=1,name=[[The Palace Of The Dead (Floors 71-80)]],help=[[]],},{level=1,name=[[The Palace Of The Dead (Floors 81-90)]],help=[[]],},{level=1,name=[[The Palace Of The Dead (Floors 91-100)]],help=[[]],},{level=1,name=[[The Palace Of The Dead (Floors 101-110)]],help=[[]],},{level=1,name=[[The Palace Of The Dead (Floors 111-120)]],help=[[]],},{level=1,name=[[The Palace Of The Dead (Floors 121-130)]],help=[[]],},{level=1,name=[[The Palace Of The Dead (Floors 131-140)]],help=[[]],},{level=1,name=[[The Palace Of The Dead (Floors 141-150)]],help=[[]],},{level=1,name=[[The Palace Of The Dead (Floors 151-160)]],help=[[]],},{level=1,name=[[The Palace Of The Dead (Floors 161-170)]],help=[[]],},{level=1,name=[[The Palace Of The Dead (Floors 171-180)]],help=[[]],},{level=1,name=[[The Palace Of The Dead (Floors 181-190)]],help=[[]],},{level=1,name=[[The Palace Of The Dead (Floors 191-200)]],help=[[]],},},patch={number=[[3.35]],},name=[[The Palace Of The Dead]],name_de=[[Palast Der Toten]],},[1794]={name_fr=[[Ponton D'entraînement]],npcs={},enemies={},patch={number=[[3.4]],},name=[[Dueling Circle]],name_de=[[Duellierplatz]],},[1795]={name_fr=[[Accueil Du Bâtiment Des Manuscrits Rares]]