 favor...]],},{level=60,name=[[The Limitless Blue (Extreme)]],help=[[As is all too often the case, a primal you felled has once again been summoned. According to Unukalhai, the stakes are even higher this time, as Bismarck's reappearance threatens to hasten the awakening of the Warring Triad─three eikons sealed within the Aetherochemical Research Facility on Azys Lla. Fortunately, you have developed a sound method for slaying flying feathered whales. The Enterprise Excelsior and your island await.]],},},name=[[The Limitless Blue]],name_de=[[Grenzenloses Blau]],},[2152]={name_fr=[[Dernier Pas]],npcs={},enemies={},name=[[Last Step]],name_de=[[Letzter Schritt]],},[2153]={name_fr=[[Harde De Wisents]],npcs={},enemies={},name=[[Wisent Herd]],name_de=[[Wisent-Herde]],},[2154]={name_fr=[[Cascade évanouissante]],npcs={},enemies={},name=[[Disappearing Falls]],name_de=[[Entschwindender Fall]],},[2156]={name_fr=[[Demainsels]],npcs={},enemies={},name=[[Morrowmotes]],name_de=[[Morgenstaub]],},[2159]={name_fr=[[Dos-brisé]],npcs={},enemies={},name=[[The Shattered Back]],name_de=[[Der Gebrochene Rücken]],},[2160]={name_fr=[[Provenance]],npcs={},enemies={},name=[[Provenance]],name_de=[[Erste Wiege]],},[2161]={name_fr=[[Turbine à Cristaux]],npcs={},enemies={},name=[[Centrifugal Crystal Engine]],name_de=[[Kristall-Zentrifugalreaktor]],},[2162]={name_fr=[[Station De Refroidissement]],npcs={},enemies={},name=[[Cooling Station]],name_de=[[Kühlstation]],},[2164]={name_fr=[[Laboratoire De Recombinaison]],npcs={},enemies={},name=[[Recombination Labs]],name_de=[[Rekombinations-Sektor]],},[2166]={name_fr=[[Centre De Contrôle De La Biosphère]],npcs={},enemies={},name=[[Habisphere Control]],name_de=[[Biosphären-Kontrollstation]],},[2170]={name_fr=[[La Cathédrale]],npcs={},enemies={},name=[[The Cathedral]],name_de=[[Kathedrale]],},[2172]={name_fr=[[Pont-canal]],npcs={},enemies={},name=[[The Aqueduct]],name_de=[[Aquädukt]],},[2173]={name_fr=[[L'arbre à Pappus]],npcs={},enemies={},name=[[The Pappus