e)]],help=[[Preserved upon the Allagan tomestone you received from Unukalhai was an extraordinary history─a detailed record of the battles fought between the eikon Sephirot and the armies of Allag. After feeding the account of this epic conflict into Azys Lla's verification systems, you have succeeded in activating what the node describes as a “combat simulation.”

Can the enigmatic technology of the ancient empire truly manifest an enhanced simulacrum of the formidable Fiend? Can this artificial incarnation truly surpass the threat posed by the original Sephirot? There is but one way to know for certain...]],},},patch={number=[[3.2]],},name=[[Containment Bay S1T7]],name_de=[[Arretur S1T7]],},[2257]={name_fr=[[Sources Du Diadème]],npcs={},enemies={},name=[[Diadem Skysprings]],name_de=[[Diadem-Himmelsquellen]],},[2258]={name_fr=[[Grotte Du Diadème]],npcs={},enemies={},name=[[Diadem Grotto]],name_de=[[Diadem-Grotte]],},[2259]={name_fr=[[Mares Du Quadrant Sud-ouest]],npcs={},enemies={},name=[[Southern Diadem Lake]],name_de=[[Südlicher Diademteich]],},[2260]={name_fr=[[Banc Du Diadème]],npcs={},enemies={},name=[[Secluded Diadem Pond]],name_de=[[Abgeschiedener Diademteich]],},[2261]={name_fr=[[Étang Du Quadrant Nord-ouest]],npcs={},enemies={},name=[[Northern Diadem Lake]],name_de=[[Nördlicher Diademteich]],},[2262]={name_fr=[[Cimes Venteuses]],npcs={},enemies={},name=[[Blustery Cloudtop]],name_de=[[Tosende Wolken]],},[2263]={name_fr=[[Cimes Calmes]],npcs={},enemies={},name=[[Calm Cloudtop]],name_de=[[Sanfte Wolken]],},[2264]={name_fr=[[Cimes Tumultueuses]],npcs={},enemies={},name=[[Swirling Cloudtop]],name_de=[[Wirbelnde Wolken]],},[2265]={name_fr=[[Unité De Contention P1P6]],npcs={},enemies={{name=[[Aion Teleos]],positions={{level=60,y=6.3,hp=1600000,x=5.9,},{level=60,y=6.3,hp=1600000,x=5.8,},{level=60,y=5.9,hp=1600000,x=5.8,},{level=60,y=5.9,hp=1600000,x=6.3,},{level=60,y=5.9,hp=1600000,x=6.1,},{level=60,y=5.9,hp=1600000,x=5.9,},{level=60,y=6.3,hp=1600000,x=6.4,},{level=60,y=6.3,hp=1600000,x=6.1,},{level=60,y=6.3,hp=1600000,x=6.3,},{level=60,y=5.9,hp=1600000,x=6.4,},},},{name=[[Barbelo]],positions={{level=60,y=6,hp=1600000,x=6.3,},},},{name=[[Sophia]],positions={{level=60,y=6.3,hp=16000,x=5,},{level=60,y=6.1,hp=16000,x=6.1,},{level=60,y=5.9,hp=16000,x=7.2,},{level=60,y=6.3,hp=16000,x=7.2,},{level=60,y=5.9,hp=16000,x=5,},{level=60,y=6.1,hp=16000,x=5,},{level=60,y=6.1,hp=16000,x=6.3,},{level=60,y=6.2,hp=16000,x=5,},{level=60,y=6.2,hp=16000,x=6.2,},{level=60,y=6.2,hp=16000,x=7.2,},{level=60,y=5.9,hp=2377600,x=6.1,},{level=60,y=6.1,hp=16000,x=7.2,},},},{name=[[The First Demiurge]],positions={{level=60,y=6.2,hp=16000,x=6.2,},},},{name=[[The Second Demiurge]],positions={{level=60,y=6,hp=88800,x=6.1,},},},{name=[[The Third Demiurge]],positions={{level=60,y=6.2,hp=92480,x=6,},},},},instances={{level=60,name=[[Containment Bay P1T6]],help=[[History tells of a Meracydian nation comprised of a multitude of races, the foundations of which were built on the worship of a single deity. The “Goddess,” as she was simply known, graced the souls of her worshipers with perfect equilibrium, binding their disparate societies in gilded chains of harmony.

In the present day, she is better known as Sophia, one of the incalculably powerful eikons of the Warring Triad. And after five thousand years of imprisonment, her failed plans for vengeance once more threaten to come to fruition. Defeat the wakened thralls and slay the stirring Goddess, lest her divine “balance” bring all the world to equal ruin!]],},{level=60,name=[[Containment Bay P1T6 (Extreme)]],help=[[A new tomestone discovered by Unukalhai contains records of ancient battles with Sophia─specialized data which will enable Azys Lla's miraculous reality augmentation technologies to generate a simulacrum of the Goddess at the height of her power. Have you the strength to overcome this challenge, as the champions of Allag once did? Enter the combat simulation, and test the limits of your might!]],},},patch={number=[[3.4]],},name=[[Containment Bay P1T6]],name_de=[[Arretur P1T6]],},[2266]={name_fr=[[Unité De Contention Z1P9]],npcs={},enemies={{name=[[Execrated Thew]],positions={{level=60,y=5.9,hp=60800,x=6.2,},{level=60,y=5.9,hp=60800,x=6.1,},{level=60,y=5.9,hp=60800,x=6,},},},{name=[[Execrated Will]],positions={{level=60,y=5.9,hp=138240,x=6.1,},{level=60,y=6.4,hp=138240,x=6.1,},{level=60,y=6.1,hp=138240,x=5.9,},},},{name=[[Execrated Wit]],positions={{level=60,y=6.1,hp=84800,x=6.4,},{level=60,y=6.3,hp=16000,x=6.3,},{level=60,y=6.1,hp=84800,x=5.9,},},},{name=[[Infinity]],positions={{level=60,y=6.1,hp=3070240,x=6.1,},},},{name=[[Zurvan]],positions={{level=60,y=6.1,hp=3070240,x=6.1,},{level=60,y=6.2,hp=16000,x=6,},},},},instances={{level=60,name=[[Containment Bay Z1T9]],help=[[Only one pillar of the Warring Triad remains: Zurvan, the Demon. Worshipped by a Meracydian race of centaur-like beings, this eikon manifested upon the physical plane as an embodiment of eternal victory. And yet, despite his godlike might, Zurvan was captured. He has languished in his Allagan-made prison now for five thousand years, his primal desire for justice swelling in magnitude with each passing millennium...

Through an unlikely alliance with the VIth Imperial Legion, you and your companions were able to prevent a catastrophic awakening orchestrated by the Demon's thralls. But your work is not yet finished. Honor the sacrifice of Regula van Hydrus, and remove the threat of Zurvan from this world once and for all!]],},{level=60,name=[[Containment Bay Z1T9 (Extreme)]],help=[[You hold a tomestone recovered from the research facility of Azys Lla. According to Unukalhai, this recording device contains the data required to generate a simulacrum of Zurvan at the peak of his original, unmitigated power─the final trial of a program designed to test the mightiest of Allag's elite champions. If you would subject yourself to the dangers of this ancient challenge, you need only approach the verification node and stretch forth your hand...]],},},patch={number=[[3.5]],},name=[[Containment Bay Z1T9]],name_de=[[Arretur Z1T9]],},[2267]={name_fr=[[La Gemme Manquante]],npcs={},enemies={},patch={number=[[3.55b]],},name=[[The Missing Gem]],name_de=[[Fehlendes Juwel]],},[2268]={name_fr=[[Faille éthérée]],npcs={},enemies={},patch={number=[[3.55b]],},name=[[Aetherial Gap]],name_de=[[Ätherfissur]],},[2269]={name_fr=[[Portail De La Gemme Manquante]],npcs={},enemies={},patch={number=[[3.55b]],},name=[[Mhachi Portal]],name_de=[[Portal Zum Fehlenden Juwel]],},[2270]={name_fr=[[Chambre Individuelle - Shirogane]],npcs={},enemies={},patch={number=[[4.1]],},name=[[Private Chambers - Shirogane]],name_de=[[Shirogane - Zimmer]],},[2271]={name_fr=[[Atelier De Compagnie - Shirogane]],npcs={},enemies={},patch={number=[[4.1]],},name=[[Company Workshop - Shirogane]],name_de=[[Gesellschafts-Werkstätte: Shirogane]],},[2272]={name_fr=[[Kobai Goten (hall)]],npcs={},enemies={},patch={number=[[4.0]],},name=[[Kobai Goten Apartment Lobby]],name_de=[[Kobai Goten (Eingangshalle)]],},[2273]={name_fr=[[Kobai Goten (appartement)]],npcs={},enemies={},patch={number=[[4.1]],},name=[[Kobai Goten Apartment]],name_de=[[Kobai Goten (Wohnung)]],},[2274]={name_fr=[[Première épreuve]],npcs={},enemies={},patch={number=[[4.01]],},name=[[Landing Point]],name_de=[[Testebene I - Vorstufe]],},[2275]={name_fr=[[Deuxième épreuve]],npcs={},enemies={},patch={number=[[4.01]],},name=[[Point II]],name_de=[[Testebene II]],},[2276]={name_fr=[[Troisième épreuve]],npcs={},enemies={},patch={number=[[4.01]],},name=[[Point III]],name_de=[[Testebene III]],},[2277]={name_fr=[[Base D'opérations Provisoire]],npcs={},enemies={},patch={number=[[4.01]],},name=[[Temporary Camp]],name_de=[[Provisorisches Lager]],},[2278]={name_fr=[[Deltastice]],npcs={},enemies={},patch={number=[[4.01]],},name=[[Deltascape]],name_de=[[Deltametrie]],},[2279]={name_fr=[[Château Dimensionnel]],npcs={},enemies={},patch={number=[[4.01]],},name=[[The Bending Citadel]],name_de=[[Dimensionsschloss]],},[2280]={name_fr=[[Château Dimensionnel - Prison Souterraine]],npcs={},enemies={},patch={number=[[4.01]],},name=[[The Dungeons]],name_de=[[Kerker]],},[2281]={name_fr=[[Château Dimensionnel - Salle Du Trône]],npcs={},enemies={},patch={number=[[4.01]],},name=[[The Audience Chamber]],name_de=[[Thronsaal]],},[2282]={name_fr=[[Château Dimensionnel - Toit]],npcs={},enemies={},patch={number=[[4.01]],},name=[[The Parapet]],name_de=[[Dach]],},[2283]={name_fr=[[Marchés De L'avenue Du Saphir]],npcs={},enemies={},patch={number=[[4.0]],},name=[[Sapphire Avenue Exchange]],name_de=[[Saphirstraßenmarkt]],},[2284]={name_fr=[[Fissure Interdimensionnelle]],npcs={},quests={{name=[[Into The Deltascape]],npc_name=[[Cid]],genre_name=[[Omega Quests]],patch={name=[[Patch 4.01]],number=[[4.01]],},},{name=[[A Catastrophe Waiting]],npc_name=[[Cid]],genre_name=[[Omega Quests]],patch={name=[[Patch 4.01]],number=[[4.01]],},},{name=[[The Croak Queen]],npc_name=[[Cid]],genre_name=[[Omega Quests]],patch={name=[[Patch 4.01]],number=[[4.01]],},},{name=[[A Void At All Costs]],npc_name=[[Cid]],genre_name=[[Omega Quests]],patch={name=[[Patch 4.01]],number=[[4.01]],},},{name=[[No Slowing Down