],help=[[Your efforts to wreak havoc on the Isle of Zekki and draw the Red Kojin away from their imperial masters have exceeded all expectations. Unfortunately, for reasons beyond your knowing, two of the sacred treasures stored in the isle's vault “reacted” to the presence of the Yasakani-no-Magatama, summoning forth from the aether the great kami Susano─a primal by another name. How fortunate that you had the wisdom and foresight to invite several of your fellow adventurers on this journey to the Far East, and how kind they were to agree to help you torment the Red Kojin, for no single warrior, no matter how blessed or powerful, could ever hope to slay a primal on her own, despite what some wandering minstrels would have you believe.]],},{level=70,name=[[The Pool Of Tribute (Extreme)]],help=[[In the shadow of Kugane's renowned Mujikoza theater, you recount your clash with Susano to the wandering minstrel. Inspired by your tale, he proceeds to commit it to song, his gift for words imbuing events with an intensity you do not quite recall. Such is common practice when adapting for the stage, the minstrel explains, as your mind wanders back to the scene of battle, the verses echoing in your mind...]],},},patch={number=[[4.0]],},name=[[The Blessed Treasury]],name_de=[[Schatzkammer]],},[2296]={name_fr=[[Laboratoire Impérial D'étude Sur Les Résonnants]],npcs={},enemies={},patch={number=[[4.0]],},name=[[The Resonatorium]],name_de=[[Transzendenz-Laboratorium]],},[2297]={name_fr=[[Mer Du Chant Des Sirènes]],npcs={},enemies={},instances={{level=61,name=[[The Sirensong Sea]],help=[[To the east of Dragonhead, near the southern cliffs of the Sea of Clouds, a significant rift in the aether has been detected. Through this rift, a massive horned demon and a small army of its invincible minions have appeared, posing a threat to the Ishgardian knights stationed at the outposts nearby. For the time being, the creatures appear content with remaining on their rocky outcropping, but for how long they will remain is uncertain. Engage the voidsent, ignoring the incessant hounding of the minions, and focusing your efforts on their leader.]],},},patch={number=[[4.0]],},name=[[The Sirensong Sea]],name_de=[[Sirenen-See]],},[2298]={name_fr=[[Château De Kugane]],npcs={},enemies={},instances={{level=70,name=[[Kugane Castle]],help=[[Having passed the seemingly endless trials imposed upon you by the Company of Heroes, you have been entrusted with the knowledge of a secret way into the Navel, the domain of the primal Titan. Courtesy of Y'shtola's magicks, the beastman aetheryte is now primed to send you to a confrontation with the Lord of Crags. Gird your loins for a struggle of titanic proportions.]],},},patch={number=[[4.0]],},name=[[Kugane Castle]],name_de=[[Schloss Kugane]],},[2299]={name_fr=[[Émanation]],npcs={},enemies={},instances={{level=67,name=[[Emanation]],help=[[Upon witnessing her daughter's death at the hands of Fordola and her Skulls, the Qalyana broodmother cried out to the heavens in despair...and a primal answered. Sri Lakshmi, patron deity of the Ananta, came forth from the aether, and the imperials were put to flight. Alas, the tale did not end there, for now the Qalyana demand that the Vira come and pay tribute to the goddess. And so it falls to you and your comrades to journey unto the Qalyana stronghold of Djanan Qhat, and put an end to Sri Lakshmi's dream.]],},{level=70,name=[[Emanation (Extreme)]],help=[[In the shadow of Kugane's renowned Mujikoza theater, you recount your clash with Sri Lakshmi to the wandering minstrel. Moved to melancholy by the tragic tale, he forgoes adapting it for the stage, choosing instead to honor the memory of the departed with a verse. So vivid are the words and sorrowful the melody, you cannot help but relive the fateful encounter in your mind's eye...]],},},patch={number=[[4.0]],},name=[[Emanation]],name_de=[[Heiligtum Der Qalyana]],},[2300]={name_fr=[[Ishgard - L'Assise]],npcs={{position={x=13.1,y=11.8,