},name=[[Raven Base]],name_de=[[Rabennest]],},[2350]={name_fr=[[Tour Nord Des Corbeaux]],npcs={},enemies={},patch={number=[[4.1]],},name=[[North Raven Tower]],name_de=[[Rabenturm Nord]],},[2351]={name_fr=[[Tour Sud Des Corbeaux]],npcs={},enemies={},patch={number=[[4.1]],},name=[[South Raven Tower]],name_de=[[Rabenturm Süd]],},[2352]={name_fr=[[Générateur D'énergie]],npcs={},enemies={},patch={number=[[4.1]],},name=[[The Generator]],name_de=[[Generator]],},[2353]={name_fr=[[Aérodrome De Kugane]],npcs={},enemies={},patch={number=[[4.1]],},name=[[Airship Landing]],name_de=[[Luftschiff-Landeplatz]],},[2354]={name_fr=[[Clairière De Jade]],npcs={},enemies={},instances={{level=70,name=[[The Jade Stoa]],help=[[At the heart of every auspice is a duality: the aramitama, the primal rage; and the nigimitama, the boundless calm. Byakko of the Four Lords is on the verge of being consumed by his aramitama, and should this come to pass, he will forever be no more than a feral beast. And so it falls to you and yours to face the legendary auspice in battle─to quell the madness within and save his soul!]],},{level=70,name=[[The Jade Stoa (Extreme)]],help=[[A devoted student of the fine arts, the wandering minstrel has recently begun studying a form of classical Hingan poetry. Duly inspired by your account of the battle for Byakko's soul, he tries his hand at one such “tanka”, seeking to capture the essence of who the auspice truly is. Even absent music, his words nevertheless have a hypnotic feeling, and you find it rather easy to recall the encounter, albeit in a more dramatic fashion...]],},},patch={number=[[4.2]],},name=[[The Jade Stoa]],name_de=[[Jadelichtung]],},[2355]={name_fr=[[Quatrième épreuve]],npcs={},enemies={},patch={number=[[4.2]],},name=[[Point IV]],name_de=[[Testebene IV]],},[2356]={name_fr=[[Cérémonie De La Valention]],npcs={},enemies={},patch={number=[[4.2]],},name=[[Valentione's Ceremony]],name_de=[[Valentionzeremonie]],},[2357]={name_fr=[[Deltastice V1.0]],npcs={},enemies={},instances={{level=70,name=[[Deltascape V1.0]],help=[[In your hunt for the elusive Omega, you and your comrades find yourselves unwitting subjects in its fiendish experiment. With no recourse but to do as bid, you resolve to venture into the Deltascape to do battle against unknown foes. Before you looms the test world, the image of a mysterious castle framed within its egg-like contour...]],},{level=70,name=[[Deltascape V1.0 (Savage)]],help=[[Taken by curiosity, you activate something called the Savage Initiative at a Garlond Ironworks terminal. Apparently a program to address work-related stress, you are treated to a soothing song composed by a certain minstrel, its lush strains massaging your mind and adding vibrant flourishes to the memories of your trials within the Deltascape...]],},},patch={number=[[4.01]],},name=[[Deltascape V1.0]],name_de=[[Deltametrie 1.0]],},[2358]={name_fr=[[Deltastice V2.0]],npcs={},enemies={},instances={{level=70,name=[[Deltascape V2.0]],help=[[You have triumphed in your maiden encounter within the Deltascape, but there are more tests to come, each bound to be more trying than the last. According to Nero's analysis, your next opponent is capable of manipulating gravity, and by way of a countermeasure, he sends you off with one of his curious contraptions: an anti-gravity gimbal.]],},{level=70,name=[[Deltascape V2.0 (Savage)]],help=[[Taken by curiosity, you activate something called the Savage Initiative at a Garlond Ironworks terminal. Apparently a program to address work-related stress, you are treated to a soothing song composed by a certain minstrel, its lush strains massaging your mind and adding vibrant flourishes to the memories of your trials within the Deltascape...]],},},patch={number=[[4.01]],},name=[[Deltascape V2.0]],name_de=[[Deltametrie 2.0]],},[2359]={name_fr=[[Deltastice V3.0]],npcs={},enemies={},instances={{level=70,name=[[Deltascape V3.0]],help=[[Fresh from your victory over the grotesque Catastrophe, you set your sights upon the next battle. Your foe is a being named Halicarnassus, an antagonist from a classical novel, wherein she rules as the Queen of Dimension Castle. Yet be it born of fact or fiction, the struggle ahead promises to be very real.]],},{level=70,name=[[Deltascape V3.0 (Savage)]],help=[[Taken by curiosity, you activate something called the Savage Initiative at a Garlond Ironworks terminal. Apparently a program to address work-related stress, you are treated to a soothing song composed by a certain minstrel, its lush strains massaging your mind and adding vibrant flourishes to the memories of your trials within the Deltascape...]],},},patch={number=[[4.01]],},name=[[Deltascape V3.0]],name_de=[[Deltametrie 3.0]],},[2360]={name_fr=[[Deltastice V4.0]],npcs={},enemies={},instances={{level=70,name=[[Deltascape V4.0]],help=[[And so you come to the final encounter in the Deltascape. Awaiting you is yet another villain from a work of fiction known as Exdeath, who is described as an evil tree that assumes the form of a dark mage. Doubt not but that this will be your toughest test yet, but overcome it you must if you are to head off Omega's threat.]],},{level=70,name=[[Deltascape V4.0 (Savage)]],help=[[Taken by curiosity, you activate something called the Savage Initiative at a Garlond Ironworks terminal. Apparently a program to address work-related stress, you are treated to a soothing song composed by a certain minstrel, its lush strains massaging your mind and adding vibrant flourishes to the memories of your trials within the Deltascape...]],},},patch={number=[[4.01]],},name=[[Deltascape V4.0]],name_de=[[Deltametrie 4.0]],},[2361]={name_fr=[[Grottes Du Lac Seld]],npcs={},enemies={},patch={number=[[4.1]],},name=[[Lookback Cave]],name_de=[[Seldsee-Grotte]],},[2362]={name_fr=[[Domaine De Kelpie]],npcs={},enemies={},patch={number=[[4.1]],},name=[[The Green Screams]],name_de=[[Kelpies Revier]],},[2363]={name_fr=[[Quartier Saint]],npcs={},enemies={},patch={number=[[4.1]],},name=[[Salvation]],name_de=[[Heilige Hallen]],},[2364]={name_fr=[[La Voie Scellée]],npcs={},enemies={},patch={number=[[4.1]],},name=[[A Door Unopened]],name_de=[[Siegelpforte]],},[2365]={name_fr=[[Quartier Condamné]],npcs={},enemies={},patch={number=[[4.1]],},name=[[Condemnation]],name_de=[[Verbotene Hallen]],},[2366]={name_fr=[[Salle Du Trésor]],npcs={},enemies={},patch={number=[[4.1]],},name=[[The Golden Walls Of Ruin]],name_de=[[Theoderics Schatzkammer]],},[2367]={name_fr=[[Cité Engloutie De Skalla]],npcs={},enemies={},instances={{level=70,name=[[The Drowned City Of Skalla]],help=[[With the aid of the Enterprise and its legendary captain, Cid Garlond, you have broken through the swirling winds that shield the Howling Eye. Yet the challenges you have surmounted pale in comparison to the one that awaits you beyond the gates. At long last, the end is nigh─be it Garuda's or your own.]],},},patch={number=[[4.1]],},name=[[The Drowned City Of Skalla]],name_de=[[Die Versunkene Stadt Skalla]],},[2368]={name_fr=[[Le Bas-fond]],npcs={},enemies={},patch={number=[[4.1]],},name=[[The Shallows]],name_de=[[Höhere Ebene]],},[2369]={name_fr=[[Les Profondeurs]],npcs={},enemies={},patch={number=[[4.1]],},name=[[The Depths]],name_de=[[Tiefere Ebene]],},[2370]={name_fr=[[Salle De Répétition Du Prima Vista]],npcs={{position={x=5.9,y=6.1,},name=[[Alma]],},{position={x=5.9,y=6,},name=[[Alma Bas Lexentale]],},{position={x=5.8,y=6.1,},name=[[Cid]],},{position={x=6.4,y=5.9,},name=[[Company Assistant]],},{position={x=6.1,y=6.4,},name=[[Company Belle]],},{position={x=6.2,y=6.4,},name=[[Company Dancer]],},{position={x=6.3,y=6.4,},name=[[Company Muscle]],},{position={x=6.1,y=5.9,},name=[[Company Musician]],},{position={x=6.3,y=6.3,},name=[[Company Thespian]],},{position={x=6.3,y=6.3,},name=[[Company Tragedian]],},{position={x=6,y=6.2,},name=[[Company Tragedienne]],},{position={x=5.9,y=5.9,},name=[[Jenomis Cen Lexentale]],},{position={x=5.9,y=5.9,},name=[[Jenomis Cen Lexentale]],},{positi