each Aetheryte Plaza]],name_de=[[Ätherytenplatz]],},[2706]={name_fr=[[Le Barbier]],npcs={},enemies={},patch={number=[[4.0]],},name=[[The Barber]],name_de=[[Lazarett]],},[2707]={name_fr=[[Temple Du Poing]],npcs={},enemies={},instances={{level=70,name=[[The Temple Of The Fist]],help=[[A terrible creature calling itself Buso has made a nearby mineshaft his new home away from the void. Slay the fiend before he can do whatever it is he came from the dark reaches of the outerworld to do.

Buso draws his power from eerie blue flames which erupt from the carcasses of minions summoned from the void and then sacrificed here in this realm. While these flames burn, Buso will be nigh indestructible. Extinguish the fires before attempting to engage him.]],},},patch={number=[[4.0]],},name=[[The Temple Of The Fist]],name_de=[[Tempel Der Faust]],},[2708]={name_fr=[[Aérodrome Royal]],npcs={},enemies={},instances={{level=70,name=[[The Royal Menagerie]],help=[[Shinryu, Ilberd's draconic god of vengeance, has been claimed by none other than Zenos yae Galvus, who has used his power as a Resonant to merge with the primal and bind it to his will. Transformed into a towering being of pure violence, his very existence poses a threat not only to Ala Mhigo, but to the entire world. All now falls to you and your comrades, for if you do not stop Zenos yae Galvus, no one will...]],},},patch={number=[[4.0]],},name=[[The Royal Airship Landing]],name_de=[[Königlicher Luftschiff-Landeplatz]],},[2709]={name_fr=[[Ménagerie Royale]],npcs={},enemies={},patch={number=[[4.0]],},name=[[The Royal Menagerie]],name_de=[[Königliche Menagerie]],},[2710]={name_fr=[[Statue Du Destructeur]],npcs={},enemies={},patch={number=[[4.0]],},name=[[The Destroyer]],name_de=[[Der Zerstörer]],},[2711]={name_fr=[[Tempête De Sang]],npcs={},enemies={},patch={number=[[4.0]],},name=[[Bloodstorm]],name_de=[[Blutsturm]],},[2712]={name_fr=[[La Récompense]],npcs={},enemies={},patch={number=[[4.0]],},name=[[Recompense]],name_de=[[Kammer Der Wiedergutmachung]],},[2713]={name_fr=[[Étang Des Étoiles Chues]],npcs={},enemies={},patch={number=[[4.0]],},name=[[Starfall]],name_de=[[Kratersee]],},[2714]={name_fr=[[Chutes Du Chakra]],npcs={},enemies={},patch={number=[[4.0]],},name=[[Chakra Falls]],name_de=[[Chakra-Wasserfall]],},[2715]={name_fr=[[Transparence]],npcs={},enemies={},instances={{level=70,name=[[The Minstrel's Ballad: Shinryu's Domain]],help=[[A god born of sorrow and despair. A man who lives only for death. As one they fought the Warrior of Light, and as one they fell. No words could do this titanic encounter justice...unless they come from the wandering minstrel, to whom no event is beyond improvement. As his nimble fingers pluck out the chords, his rich voice carries you to a place above the world, one that is at once familiar and foreign: Shinryu's domain.]],},},patch={number=[[4.0]],},name=[[Transparency]],name_de=[[Raum Der Transparenz]],},[2716]={name_fr=[[Mythe]],npcs={},enemies={},patch={number=[[4.1]],},name=[[Myth]],name_de=[[Mythos]],},[2717]={name_fr=[[Sigmastice V1.0]],npcs={},enemies={},instances={{level=70,name=[[Sigmascape V1.0]],help=[[You are once more summoned to Omega's rift between dimensions, this time to conquer the denizens of the Sigmascape. With no spatial anchor to help pinpoint the correct segment of data, you are forced to enter the first battle bereft of any insightful analysis. Senses straining and nerves taut, you could swear you hear a high-pitched whistle echoing within the arena beyond...]],},{level=70,name=[[Sigmascape V1.0 (Savage)]],help=[[The urge to flip switches is almost irresistible...even when you know full well the consequences for doing so. Once more your finger moves as if of its own accord, and activates the second phase of the Savage Initiative. As the gentle arrangement drifts from the terminal, you are transported to a remembered vista of the Sigmascape, each lapping wave of the song swelling the boundary of your memories... ]],},},patch={number=[[4.2]],},name=[[Sigmascape V1.0]],name_de=[[Sigmametrie 1.0]],},[2718]={name_fr=[[Sigmastice V2.0]],npcs={},enemies={},instances={{level=70,name=[[Sigmascape V2.0]],help=[[Chadarnook. According to Cid and Nero's research, such is the name given to your next devilish opponent. Had you not just won a battle against a spectral train, you might think the idea of a haunted painting absurd. Thankful for the inventive genius of your companions, you go forth armed with the Chocobo Brush─a tool specifically designed to help you overcome this bizarre encounter.]],},{level=70,name=[[Sigmascape V2.0 (Savage)]],help=[[The urge to flip switches is almost irresistible...even when you know full well the consequences for doing so. Once more your finger moves as if of its own accord, and activates the second phase of the Savage Initiative. As the gentle arrangement drifts from the terminal, you are transported to a remembered vista of the Sigmascape, each lapping wave of the song swelling the boundary of your memories... ]],},},patch={number=[[4.2]],},name=[[Sigmascape V2.0]],name_de=[[Sigmametrie 2.0]],},[2719]={name_fr=[[Sigmastice V3.0]],npcs={},enemies={},instances={{level=70,name=[[Sigmascape V3.0]],help=[[Known simply as the “Guardian,” this foe is described by Cid as the machine responsible for defending a capital city. As a creation of otherworldly engineering it is impossible to know exactly what weapons it will bring to bear─only that this will be a contest of force versus overwhelming brute force.]],},{level=70,name=[[Sigmascape V3.0 (Savage)]],help=[[The urge to flip switches is almost irresistible...even when you know full well the consequences for doing so. Once more your finger moves as if of its own accord, and activates the second phase of the Savage Initiative. As the gentle arrangement drifts from the terminal, you are transported to a remembered vista of the Sigmascape, each lapping wave of the song swelling the boundary of your memories... ]],},},patch={number=[[4.2]],},name=[[Sigmascape V3.0]],name_de=[[Sigmametrie 3.0]],},[2720]={name_fr=[[Sigmastice V4.0]],npcs={},enemies={},instances={{level=70,name=[[Sigmascape V4.0]],help=[[The looming face of the Sigmascape, “Kefka” will be your final opponent in this test world. Analysis of his data reveals that, despite his comical appearance, this cackling jester once rose to godhood and cast his entire planet into ruin. His is a power not to be underestimated. Nero has also alerted you to the villain's propensity for trickery, and promised to watch for deadly feints through his enhanced monitor. You can only hope that his warnings come in time...]],},{level=70,name=[[Sigmascape V4.0 (Savage)]],help=[[The urge to flip switches is almost irresistible...even when you know full well the consequences for doing so. Once more your finger moves as if of its own accord, and activates the second phase of the Savage Initiative. As the gentle arrangement drifts from the terminal, you are transported to a remembered vista of the Sigmascape, each lapping wave of the song swelling the boundary of your memories... ]],},},patch={number=[[4.2]],},name=[[Sigmascape V4.0]],name_de=[[Sigmametrie 4.0]],},[2721]={name_fr=[[Forêt Des Illusions]],npcs={},enemies={},patch={number=[[4.2]],},name=[[Phantom Forest]],name_de=[[Phantomwald]],},[2722]={name_fr=[[Cave De La Maison]],npcs={},enemies={},patch={number=[[4.2]],},name=[[Mansion Cellar]],name_de=[[Herrenhauskeller]],},[2723]={name_fr=[[Tour De Kefka]],npcs={},enemies={},patch={number=[[4.2]],},name=[[Lower Tower Of Ruin]],name_de=[[Unterer Turm Des Ruins]],},[2724]={name_fr=[[Sommet De La Tour De Kefka]],npcs={},enemies={},patch={number=[[4.2]],},name=[[Upper Tower Of Ruin]],name_de=[[Oberer Turm Des Ruins]],},[2750]={name_fr=[[Rasen Kaikyo]],npcs={},enemies={},patch={number=[[4.0]],},name=[[Rasen Kaikyo]],name_de=[[Rasen Kaikyo]],},[2751]={name_fr=[[Côte Orientale D'Othard]],npcs={},enemies={},patch={number=[[4.0]],},name=[[East Othard Coastline]],name_de=[[Ostküste Othards]],},[2752]={name_fr=[[Chaîne Du Gensui]],npcs={},enemies={},patch={number=[[4.0]],},name=[[The Gensui Chain]],name_de=[[Gensui-Gipfelkette]],},[2753]={name_fr=[[Bassin Rutilant]],npcs={},enemies={},patch={number=[[4.0]],},name=[[The Glittering Basin]],name_de=[[Goldbecken]],},[2754]={name_fr=[[Vallée Aux Prismes]],npcs={},enemies={},patch={number=[[4.0]],},name=[[Valley Of The Fallen Rainbow]],name_de=[[Regenbogental]],},[2755]={name_fr=[[Doma]],npcs={},en